[12828] = {name = "[q2]Plans : Marteau volcanique", additional_info = "Forge (290) requis\n[q2]Utilise: Vous apprend à forger un Marteau volcanique.\n[q2]Marteau volcanique\nLié quand équipé\nMain droite Masse\nDégâts : 60 - 113 Vitesse 2.50\n(34.60 dégâts par seconde)\nDurabilité 75 / 75\nNiveau 53 requis\n[q2]Chances quand vous touchez : Lance une boule enflammée qui inflige 100 to 128 points de dégâts de Feu et 18 points de dégâts supplémentaires en 6 sec.\nRequiert Barre de thorium (30), Coeur de feu (4), Rubis étoilé (4), Cuir robuste (4)"},
