[16047] = {name = "Schéma : Tube en thorium", additional_info = "Ingénierie (275) requis\n[q2]Utilise: Vous apprend à fabriquer un Tube en thorium.\nTube en thorium\nRequiert Barre de thorium (6)"},
[16048] = {name = "[q2]Schéma : Carabine en sombrefer", additional_info = "Ingénierie (275) requis\n[q2]Utilise: Vous apprend à fabriquer une Carabine en sombrefer.\n[q3]Carabine en sombrefer\nLié quand équipé\nÀ distance Arme à feu\nDégâts : 53 - 100 Vitesse 2.70\n(28.33 dégâts par seconde)\nDurabilité 75 / 75\nNiveau 50 requis\n[q2]Équipé : Vous donne une chance d’infliger 18 to 26 points de dégâts d'Ombre avec un Tir de l'ombre à votre cible à distance.\nRequiert Tube en thorium (2), Barre de sombrefer (6), Lunette mortelle (2), Saphir bleu (2), Grande opale (2), Cuir robuste (4)"},
[16049] = {name = "[q2]Schéma : Bombe en sombrefer", additional_info = "Ingénierie (285) requis\n[q2]Utilise: Vous apprend à fabriquer une Bombe en sombrefer.\nBombe en sombrefer\nIngénierie (285) requis\n[q2]Utilise: Inflige 225 to 675 points de dégâts de Feu et étourdit les cibles dans un rayon de 5 mètres pendant 4 sec. Tous les dégâts interrompent l'effet (1 Min Recharge)\nRequiert Rouage en thorium (2), Barre de sombrefer , Poudre d'explosion dense (3), Etoffe runique (3)"},
[16050] = {name = "Schéma : Convertisseur d'arcanite délicat", additional_info = "Ingénierie (285) requis\n[q2]Utilise: Vous apprend à fabriquer un Convertisseur d'arcanite délicat.\nConvertisseur d'arcanite délicat\nRequiert Barre d'arcanite , Soie d'araignée toilacier"},
[16051] = {name = "[q2]Schéma : Obus en thorium", additional_info = "Ingénierie (285) requis\n[q2]Utilise: Vous apprend à fabriquer des Obus en thorium.\n[q2]Obus en thorium\nMunitions Balle\nAjoute 17.5 dégâts par seconde\nNiveau 52 requisRequiert Barre de thorium (2), Poudre d'explosion dense"},
[16052] = {name = "[q2]Schéma : Modulateur d'amplification vocale", additional_info = "Ingénierie (290) requis\n[q2]Utilise: Vous apprend à fabriquer un Modulateur d'amplification vocale.\n[q2]Modulateur d'amplification vocale\nLié quand équipé\nCou\n[q2]Équipé : Augmente votre résistance aux effets de silence de 7%.\nRequiert Convertisseur d'arcanite délicat (2), Batterie en or , Rouage en thorium , Grande opale"},
[16053] = {name = "[q2]Schéma : Lunettes de maître ingénieur", additional_info = "Ingénierie (290) requis\n[q2]Utilise: Vous apprend à fabriquer des Lunettes de maître ingénieur.\n[q2]Lunettes de maître ingénieur\nLié quand équipé\nTête Tissu\nArmure : 61\n+16 Endurance\n+17 Esprit\nDurabilité 45 / 45\nIngénierie (280) requisRequiert Lunettes de feu , Enorme émeraude (2), Cuir enchanté (4)"},
[16054] = {name = "[q2]Schéma : Petit dragon en arcanite", additional_info = "Ingénierie (300) requis\n[q2]Utilise: Vous apprend à fabriquer un Petit dragon en arcanite.\nDépouillé sur: Tisse-magie cobalt\nChance de Butin: 2.29%\n[q3]Petit dragon en arcanite\nLié quand équipé\nUniqueBijou\nNiveau 50 requis\nIngénierie (300) requis\n[q2]Utilise: Active votre Petit dragon en arcanite pour qu'il se batte à votre place pendant 1 min. Il doit refroidir pendant une heure avant de pouvoir être utilisé à nouveau. (1 Heure Recharge)\nRequiert Petit dragon mécanique en mithril , Convertisseur d'arcanite délicat (8), Barre de thorium enchanté (10), Rouage en thorium (6), Batterie en or (4), Cuir enchanté (6)"},
[16055] = {name = "[q2]Schéma : Bombe des arcanes", additional_info = "Ingénierie (300) requis\n[q2]Utilise: Vous apprend à fabriquer une Bombe des arcanes.\nBombe des arcanes\nIngénierie (300) requis\n[q2]Utilise: Draine 675 to 1125 points de mana à toutes les cibles présentes dans le rayon de l'explosion et transforme 50% du nombre de points de mana drainé en points de dégâts infligés. Rend muettes les cibles présentes dans le rayon de l'explosion pendant 5 sec. (1 Min Recharge)\nRequiert Convertisseur d'arcanite délicat , Barre de thorium (3), Etoffe runique"},
[16056] = {name = "[q2]Schéma : Carabine en arcanite sans défaut", additional_info = "Ingénierie (300) requis\n[q2]Utilise: Vous apprend à fabriquer une Carabine en arcanite sans défaut.\n[q3]Carabine en arcanite sans défaut\nLié quand équipé\nÀ distance Arme à feu\nDégâts : 65 - 122 Vitesse 3.00\n(31.17 dégâts par seconde)\nDurabilité 75 / 75\nNiveau 56 requis\n[q2]Équipé : Armes à feu augmentées de 4.\n[q2]Équipé : +10 à la puissance des attaques à distance.\nRequiert Barre d'arcanite (10), Tube en thorium (2), Essence de feu (2), Essence de terre (2), Diamant d'Azeroth (2), Cuir enchanté (2)"},
