[19211] = {name = "Plans : Garde noire", additional_info = "Lié quand ramassé\nForge (300) requis\nRequiertMaître Fabricant d'épées\n[q2]Utilise: Vous apprend à forger Garde noire.\n[q4]Garde noire\nLié quand équipé\nÀ une main Epée\nDégâts : 65 - 121 Vitesse 1.80\n(51.67 dégâts par seconde)\n+9 Endurance\nDurabilité 105 / 105\nNiveau 60 requis\n[q2]Équipé : Augmente vos chances de parer une attaque de 1%.\nRequiert Noyau de lave (6), Noyau de feu (6), Barre d'arcanite (10), Barre de sombrefer (6), Pierre de gardien (12)"},
[19212] = {name = "Plans : Crépuscule", additional_info = "Lié quand ramassé\nForge (300) requis\nRequiertMaître fabricant de haches\n[q2]Utilise: Vous apprend à forger Crépuscule.\n[q4]Crépuscule\nLié quand équipé\nDeux mains Hache\nDégâts : 187 - 282 Vitesse 3.50\n(67.00 dégâts par seconde)\nDurabilité 120 / 120\nNiveau 60 requis\n[q2]Chances quand vous touchez : Les dégâts des sorts encaissés par la cible sont augmentés de 15% pendant 5 sec.\nRequiert Noyau de lave (8), Noyau de feu (5), Barre d'arcanite (10), Barre de sombrefer (12), Enorme émeraude (4)"},
