[19215] = {name = "Patron : Sagesse des Grumegueules", additional_info = "Lié quand ramassé\nCouture (290) requis\nRequiertLes Grumegueules\n- Honoré\n[q2]Utilise: Vous apprend à coudre la Sagesse des Grumegueules.\n[q3]Sagesse des Grumegueules\nLié quand équipé\nTaille Tissu\nArmure : 46\n+21 Intelligence\nDurabilité 30 / 30\nNiveau 53 requis\n[q2]Équipé : Rend 4 points de mana toutes les 5 secondes.\nRequiert Rouleau d'étoffe runique (8), Essence de terre (3), Essence de vie (3), Soie d'araignée toilacier (2)"},
[19216] = {name = "Patron : Bottes de l'Aube d'argent", additional_info = "Lié quand ramassé\nCouture (290) requis\nRequiertAube d'argent\n- Honoré\n[q2]Utilise: Vous apprend à coudre des Bottes de l'Aube d'argent.\n[q3]Bottes de l'Aube d'argent\nLié quand équipé\nPieds Tissu\nArmure : 57\n+21 Endurance\n+7 Esprit\n+4 à la résistance Ombre\nDurabilité 40 / 40\nNiveau 53 requisRequiert Rouleau d'étoffe runique (6), Cuir enchanté (4), Perle dorée (2), Pierre de gardien (2), Soie d'araignée toilacier (2)"},
