[22219] = {name = "Plans : Bouclier dentelé en obsidienne", additional_info = "Lié quand ramassé\nForge (300) requis\nRequiertCercle cénarien\n- Révéré\n[q2]Utilise: Vous apprend à forger un Bouclier dentelé en obsidienne.\n[q4]Bouclier dentelé en obsidienne\nLié quand équipé\nMain gauche Bouclier\nArmure : 2645\nBloquer : 48\nDurabilité 120 / 120\nNiveau 60 requis\n[q2]Équipé : Augmente vos chances de bloquer les attaques avec un bouclier de 2%.\n[q2]Équipé : +5 à toutes les résistances.\n[q2]Équipé : Quand vous êtes frappé par un sort offensif, 5% de chances que le lanceur de ce sort soit réduit au silence pendant 3 sec. (Chance d'occurence :5%, 20sec de recharge)\nRequiert Grand éclat d'obsidienne (8), Petit éclat d'obsidienne (24), Barre de thorium enchanté (8), Essence de terre (4)"},
[22220] = {name = "[q3]Plans : Emprise noire du Destructeur", additional_info = "Forge (300) requis\n[q2]Utilise: Vous apprend à forger l'Emprise noire du Destructeur.\n[q4]Emprise noire du Destructeur\nLié quand équipé\nMains Mailles\nArmure : 279\nDurabilité 50 / 50\nNiveau 60 requis\n[q2]Équipé : +28 à la puissance d'attaque.\n[q2]Équipé : Augmente vos chances d'infliger un coup critique de 1%.\n[q2]Équipé : Lors d'une attaque en mêlée ou à distance réussie, vous gagnez 8 points de mana et en drainez 8 à la cible si c'est possible.\nRequiert Grand éclat d'obsidienne (8), Petit éclat d'obsidienne (24), Cuir enchanté (8), Flacon de pouvoir suprême"},
[22221] = {name = "Plans : Tunique de mailles en obsidienne", additional_info = "Lié quand ramassé\nForge (300) requis\nRequiertCercle cénarien\n- Exalté\n[q2]Utilise: Vous apprend à forger une Tunique de mailles en obsidienne.\n[q4]Tunique de mailles en obsidienne\nLié quand équipé\nTorse Mailles\nArmure : 458\nDurabilité 140 / 140\nNiveau 60 requis\n[q2]Équipé : +76 à la puissance d'attaque.\n[q2]Équipé : Augmente vos chances d'infliger un coup critique de 1%.\n[q2]Équipé : Les dégâts des sorts subis sont diminués de 10.\nRequiert Grand éclat d'obsidienne (15), Petit éclat d'obsidienne (36), Cuir enchanté (12), Pierre de gardien (10), Diamant d'Azeroth (4)"},
[22222] = {name = "[q3]Plans : Cuirasse épaisse en obsidienne", additional_info = "Forge (300) requis\n[q2]Utilise: Vous apprend à forger une Cuirasse épaisse en obsidienne.\n[q4]Cuirasse épaisse en obsidienne\nLié quand équipé\nTorse Plaques\nArmure : 814\n+38 Force\n+16 Endurance\nDurabilité 165 / 165\nNiveau 60 requis\n[q2]Équipé : Lorsque vous êtes victime d'un sort de dégâts non périodique, vous avez 30% de chances d'obtenir un bouclier contre les sorts pendant 6 sec qui absorbe 300 to 500 points de cette école de dégâts. (Chance d'occurence :30%, 10sec de recharge)\nRequiert Grand éclat d'obsidienne (18), Petit éclat d'obsidienne (40), Barre de thorium enchanté (12), Essence de terre (10), Enorme émeraude (4)"},
