[23060] = {name = "[q0]Anneau de la faucheuse d'os", additional_info = "Lié quand ramassé\nUniqueDoigt\n+20 Force\n+20 Agilité\n+10 Endurance\nClasses : Voleur\nNiveau 60 requis\n[q2]Équipé : Augmente vos chances de toucher de 1%.\n\n[q]Armure de la faucheuse d'os (0/9)\n[q0]Brassards de la faucheuse d'os\nCuirasse de la faucheuse d'os\nGantelets de la faucheuse d'os\nCasque de la faucheuse d'os\nCuissots de la faucheuse d'os\nEspauliers de la faucheuse d'os\nSolerets de la faucheuse d'os\nSangle de la faucheuse d'os\nAnneau de la faucheuse d'os\n[q0](2) Set : Vos attaques normales de mêlée ont une chance de vous revigorer, ce qui vous soigne pour 90 to 110 points de vie.\n(4) Set : Vos coups critiques en Attaque sournoise, Attaque pernicieuse, et Hémorragie vous font récupérer 5 points d'énergie. (500ms de recharge)\n(6) Set : Réduit la menace générée par vos Attaques sournoises, Attaques pernicieuses, Hémorragies, et Eviscérations.\n(8) Set : Votre Eviscération gagne une chance par point de combo de révéler un défaut dans l'armure de votre adversaire, ce qui vous donne 100% de chance de faire une réussite critique avec votre prochaine Attaque sournoise, Attaque pernicieuse, ou Hémorragie."},
