[191267] = {name = "[q2]Rune de téléportation : antichambre", additional_info = "Lié quand ramassé\nDurée : 7 jours\n[q2]Utilise: Vous téléporte dans l’antichambre de Naxxramas."},
[191268] = {name = "[q2]Orbe de corruption", additional_info = "Lié quand ramassé\nDurée : 7 jours\n[q2]Utilise: Vous fracassez l’orbe, ce qui augmente de 50% pendant 30 min la quantité de pierres de mort inférieures absorbées sur les sbires de Kel’Thuzad."},
[191272] = {name = "[q3]Bâtonnet de nécromancie", additional_info = "Lié quand ramassé\nDurée : 7 jours\n[q2]Utilise: Soumet à sa volonté une cible morte-vivante à Naxxramas. La victime est charmée pendant 5 min.\n3 Charges"},
[191280] = {name = "[q3]Amas de spores fongiques", additional_info = "Lié quand ramassé\nDurée : 7 jours\n[q2]Utilise: Confère à vos techniques défensives une chance d’invoquer une spore qui applique Floraison fongique aux personnages-joueurs proches tués. Cet effet dure 1 hour.\n\nFloraison fongique \n150 points de dégâts de nature infligés toutes les 1 s. Chances de coup critique des attaques de mêlée ou à distance et des sorts augmentées de 15%. (Chance d'occurence :10%, 15sec de recharge)"},
[191288] = {name = "[q4]Rune de téléportation : antre du Wyrm de givre", additional_info = "Lié quand ramassé\nDurée : 7 jours\n[q2]Utilise: Vous téléporte dans l’antre du Wyrm de givre, à Naxxramas."},
[191292] = {name = "[q3]Dague rituelle", additional_info = "Lié quand ramassé\nDurée : 7 jours\n[q2]Utilise: Vous absorbez la force vitale des créatures qui vous entourent, ce qui augmente votre Endurance de 3 pour chaque cible touchée. Cet effet est cumulable jusqu’à 40 fois et dure 1 hour."},
[191312] = {name = "[q4]Phylactère de secours", additional_info = "Lié quand ramassé\nUnique\nDurée : 7 joursBijou\nNiveau 60 requis\n[q2]Équipé : Permet d’éviter une attaque qui devrait normalement vous tuer. Le déclenchement de cet effet vous rend également insensible aux dégâts pendant 3 sec et brise le phylactère."},
[191313] = {name = "Masque funéraire", additional_info = "Durée : 7 jours\n[q2]Utilise: Adopte l’apparence des autochtones de Naxxramas."},
[191414] = {name = "[q3]Relique squelette", additional_info = "Lié quand ramassé\nDurée : 7 jours\n[q2]Utilise: Piège l’âme de la cible morte et vous confère un effet bénéfique pendant 1 hour."},
[191458] = {name = "[q0]Phylactère brisé", additional_info = "Lié quand ramassé\nUnique\nDurée : 7 joursBijou\nNiveau 60 requis\n[q]\"Inerte et hors d’usage.\""},
[191459] = {name = "[q4]Rune de bonne fortune", additional_info = "Lié quand ramassé\nDurée : 7 jours\n[q2]Utilise: Kel’Thuzad et ses lieutenants sont renforcés par l’énergie nécromantique, ce qui améliore leurs points de vie et leurs dégâts. Les ennemis renforcés rapportent des récompenses supplémentaires lorsqu’ils sont vaincus.\n\n Cet effet est cumulable et dure une semaine."},
[191477] = {name = "[q4]Barre d’attache squelettique", additional_info = "Lié quand ramassé\nUnique\nDurée : 7 jours\nNiveau 60 requis\n[q2]Utilise: Invoque une barre d’attache squelettique.\n\n Les membres du groupe peuvent s’en servir pour obtenir un palefroi squelettique."},
[191480] = {name = "[q4]Palefroi squelettique", additional_info = "Lié quand ramassé\nUnique\nDurée : 1 heure\nMonture\nNiveau 40 requis\n[q2]Utilise: Invoque et renvoie un palefroi squelettique, qui obéit au personnage qui l’invoque et peut être utilisé comme monture à Naxxramas. Toute action hostile envers le cavalier fait fuir le palefroi. (3 S Recharge)"},
