[191660] = {name = "[q3]Éclairs de Thaddius", additional_info = "Lié quand ramassé\nDurée : 7 jours\n[q2]Utilise: Vous fixez les éclairs autour de votre cou, ce qui applique aléatoirement une charge positive ou négative augmentant les dégâts et les soins de 1%.\n\n Cet effet se cumule lorsque des alliés proches portent une charge similaire et inflige des dégâts de nature aux alliés portant une charge opposée."},
[191661] = {name = "[q3]Croc d’araignée monstrueux", additional_info = "Lié quand ramassé\nDurée : 7 jours\n[q2]Utilise: Vous vous plantez le croc dans le corps, ce qui augmente vos vitesses de déplacement, d’attaque et d’incantation de 15% pendant 1 hour. (Chance d'occurence :5%, 30sec de recharge)"},
