[202251] = {name = "Sac de friandises pour animaux", additional_info = "Lié quand ramassé\n[q2]Utilise: Ouvre un sac de friandises et en glisse dans la poche de votre cible, ce qui augmente les dégâts subis par les bêtes de 20. (1 Min Recharge)"},
[202254] = {name = "[q3]Brassards de redirection", additional_info = "Lié quand équipé\nPoignets Cuir\nArmure : 44\n+11 Endurance\n+13 Intelligence\n+8 Esprit\nDurabilité 35 / 35\nNiveau 60 requis\n[q2]Équipé : Augmente vos chances d'infliger un coup critique avec vos sorts de 1%."},
[202256] = {name = "[q2]Pistolet orné de corsaire", additional_info = "Lié quand ramassé\nÀ distance Arme à feu\nDégâts : 6 - 13 Vitesse 1.90\n(5.00 dégâts par seconde)\nDurabilité 35 / 35Classes : Voleur\n[q2]Équipé : Vous obtenez la technique Tireur rapide :\n\n\nVous dégainez une arme à distance pour tirer rapidement sur l’adversaire, ce qui lui inflige les dégâts normaux de l’arme à distance et réduit sa vitesse de déplacement de 50 % pendant 6 sec. Octroie 1 point de combo.\n\n Tireur rapide bénéficie de tous les talents et effets qui sont déclenchés par ou modifient Attaque pernicieuse."},
[202316] = {name = "Runecarving Test - Crippling Poison", additional_info = "Classes : Voleur\nNiveau 20 requis\n[q2]Utilise: Enduit une arme de poison durant 30 minutes.\n Chaque coup a 30 % de chances d’empoisonner l’ennemi et de réduire sa vitesse de déplacement de 50 % pendant 12 sec. (Chance d'occurence :30%)"},
[202641] = {name = "Cahier recouvert de boue", additional_info = "Lié quand ramassé\nCet objet permet de lancer une quêteClasses : Voleur\n[q]\"Ce carnet est recouvert de boue, mais des runes sont inscrites sur ses pages, ainsi qu’une courte note rédigée dans une sorte d’argot.\""},
[203723] = {name = "Note de Cutty", additional_info = "Lié quand ramassé\nClasses : Voleur\n[q]\"Un message écrit dans la langue des voleurs.\"\n[q2]<Clique Droit pour Lire>"},
[203726] = {name = "[q2]Rune de Cutty", additional_info = "Classes : Voleur"},
[203745] = {name = "[q2]Notes de sort : Javelot de glace", additional_info = "Lié quand ramassé\nUnique\nGravure\n(1) requis\n[q2]Grave sur vos gants la rune Javelot de glace :\n\n\nInflige de [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 55 / 100] à [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 65 / 100] points de dégâts de givre à une cible ennemie. Les dégâts sont triplés sur les cibles gelées.\n[q]\"Vous apprend une nouvelle technique de gravure runique.\""},
[203746] = {name = "[q2]Notes de sort : Flamme vivante", additional_info = "Lié quand ramassé\nUnique\nGravure\n(1) requis\n[q2]Grave sur votre pantalon la rune Flamme vivante :\n\n\nInvoque une flamme magique qui se dirige vers la cible en laissant une traînée de feu-sorcier. Cette traînée inflige [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 100 / 100] dégâts de feu-sorcier toutes les secondes aux ennemis proches. Dure 20 sec.\n[q]\"Vous apprend une nouvelle technique de gravure runique.\""},
[203747] = {name = "[q2]Notes de sort : Doigts de givre", additional_info = "Lié quand ramassé\nUnique\nGravure\n(1) requis\n[q2]Grave sur votre poitrine ou votre robe la rune Doigts de givre :\n\n\nDonne à vos effets d’engourdissement 15 % de chances de déclencher l’effet Doigts de givre, qui permet à vos 2 prochains sorts d’agir comme si la cible était Gelée. Dure 15 sec.\n[q]\"Vous apprend une nouvelle technique de gravure runique.\""},
[203748] = {name = "[q2]Notes de sort : Incandescence", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\n[q2]Grave sur votre poitrine la rune Ardeur épuisante :\n\n\nAugmente les chances de coup critique avec tous les sorts de 15 % mais vos coups critiques de sorts non-périodiques coûtent 1 % de votre mana de base en plus.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[203749] = {name = "[q2]Notes de sort : Illumination", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\n[q2]Grave sur votre poitrine ou votre robe la rune Illumination :\n\n\nVous infligez 10 % de dégâts supplémentaires lorsque vous avez plus de 70 % de votre mana. Sous 30 % de mana, 10 % de votre régénération de mana se poursuit pendant l’incantation.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[203750] = {name = "Carte au trésor d’Elwyn", additional_info = "Lié quand ramassé\nClasses : Voleur\n[q2]Utilise: Exhume un trésor à l’endroit indiqué (1 Min Recharge)\n[q]\"À l’ouest de la tour de la Crête. Près de la souche derrière la tanière du rôdeur.\""},
[203751] = {name = "[q2]Notes de sort : ALEEV DJEG LTACO", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\n[q2]Utilise: Déchiffre les notes de sort avec un manuel de compréhension pour apprendre un nouveau sort de gravure."},
