[203961] = {name = "[q2]Page 3 des notes d’apprenti Azora", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Combine 6 notes d’apprenti Azora pour créer une nouvelle recette de gravure."},
[203962] = {name = "[q2]Page 4 des notes d’apprenti Azora", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Combine 6 notes d’apprenti Azora pour créer une nouvelle recette de gravure."},
[203990] = {name = "[q2]Idole de mutilation", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur vos gants la rune Estropier :\n\n\nAttaque instantanément avec les deux armes et inflige 100 % des dégâts des armes plus [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] avec chacune. Les dégâts sont augmentés de 20 % contre les cibles empoisonnées. Vous gagnez 2 points de combo.\n\n Estropier bénéficie de tous les talents et effets qui se déclenchent à partir de ou modifient Attaque sournoise, sauf indication contraire.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[203991] = {name = "[q2]Rune de Tireur rapide", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur votre poitrine ou votre robe la rune Tireur rapide :\n\n\nVous dégainez une arme à distance pour tirer rapidement sur l’adversaire, ce qui lui inflige les dégâts normaux de l’arme à distance et réduit sa vitesse de déplacement de 50 % pendant 6 sec. Octroie 1 point de combo.\n\n Tireur rapide bénéficie de tous les talents et effets qui sont déclenchés par ou modifient Attaque pernicieuse.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[203992] = {name = "[q2]Rune de supercherie", additional_info = "Classes : Voleur\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[203993] = {name = "[q2]Rune de Massacre", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur votre poitrine ou votre robe la rune Ombres meurtrières :\n\n\nRéduit de 20 le coût en énergie de vos techniques Attaque sournoise et Embuscade.\n\nGravure de gants (Estropier)\nNe fonctionne pas avec Estropier\n\n Ne s’applique pas aux techniques apprises grâce à d’autres runes.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[203994] = {name = "[q2]Rune de Breuvage mortel", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur votre poitrine ou votre robe la rune Breuvage mortel :\n\n\nConfère plusieurs améliorations à vos poisons :\n\n Lorsque vous infligez un autre poison à une cible, vous lui infligez également Poison mortel.\n\n Si vous n’avez pas appliqué de poison sur votre arme, elle a une chance de déclencher Poison instantané comme s’il avait été appliqué.\n\n Votre puissance d’attaque augmente à présent les dégâts de Poison mortel et Poison instantané.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[204174] = {name = "[q2]Rune de précision", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur votre pantalon la rune Entre les deux yeux :\n\n\nCoup de grâce à distance qui inflige des dégâts en fonction du nombre de points de combo, augmenté par la puissance d’attaque et étourdit la cible :\n\n 1 point : de [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))] à [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))] points de dégâts, 1 s d’étourdissement\n 2 points : de [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)] à [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)] points de dégâts, 2 s d’étourdissement\n 3 points : de [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)] à [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)] points de dégâts, 3 s d’étourdissement\n 4 points : de [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)] à [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)] points de dégâts, 4 s d’étourdissement\n 5 points : de [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)] à [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)] points de dégâts, 5 s d’étourdissement\n\n Temps de recharge partagé avec Aiguillon perfide.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[204270] = {name = "Noyau de la Brasse", additional_info = "Unique"},
[204441] = {name = "[q2]Rune de Frénésie sanglante", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Grave sur votre poitrine la rune Frénésie sanglante :\n\n\nChaque fois que vous infligez des dégâts de saignement, vous gagnez 3 points de rage.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[204476] = {name = "Tête de Kobold coupée", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un trophée sinistre. Peut intéresser le bon collectionneur…\""},
[204477] = {name = "Tête de Murloc coupée", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un trophée sinistre. Peut intéresser le bon collectionneur…\""},
[204478] = {name = "Tête de Gnoll coupée", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un trophée sinistre. Peut intéresser le bon collectionneur…\""},
[204688] = {name = "Premier fragment de rune de chasseurs de monstres", additional_info = "[q2]Utilise: Combiner avec 2 autres morceaux pour former la rune complète."},
[204689] = {name = "Deuxième fragment de rune de chasseurs de monstres", additional_info = "[q2]Utilise: Combiner avec 2 autres morceaux pour former la rune complète."},
[204690] = {name = "Troisième fragment de rune de chasseurs de monstres", additional_info = "[q2]Utilise: Combiner avec 2 autres morceaux pour former la rune complète."},
[204703] = {name = "[q2]Rune de Dévastation", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Grave sur vos gants la rune Dévaster :\n\n\nPendant que vous êtes en posture défensive et portez un bouclier, Fracasser armure inflige également 150 % des dégâts par seconde de l’arme, augmentés de 10 % par application de Fracasser armure déjà présente sur la cible.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[204716] = {name = "[q2]Rune d’assaut frénétique", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Grave sur votre pantalon la rune Assaut frénétique :\n\n\nEn maniant des armes à deux mains, votre vitesse d’attaque est augmentée de 20 %.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[204795] = {name = "[q2]Rune de Frappe des ténèbres", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur vos gants la rune Frappe-ténèbres :\n\n\nVous téléporte derrière la cible et la frappe, ce qui inflige 150 % des dégâts de l’arme. Vous devez être camouflé(e). Octroie 1 point de combo.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[204804] = {name = "[q3]Bracelets des Hydraxiens", additional_info = "Lié quand ramassé\nPoignets Mailles\nArmure : 95\n+4 Force\n+7 Endurance\nDurabilité 40 / 40\nNiveau 25 requis"},
[204806] = {name = "[q2]Rune d’Ivresse de la victoire", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Grave sur vos gants la rune Ivresse de la victoire :\n\n\nAttaque instantanément la cible, lui inflige (1 + Attack power * 45 / 100) points de dégâts et vous soigne pour un montant égal à 10 % de votre maximum de points de vie. Peut seulement être utilisée dans les 20 sec après avoir tué un ennemi qui rapporte de l’expérience ou de l’honneur.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[204807] = {name = "[q3]Lame des profondeurs", additional_info = "Lié quand ramassé\nDeux mains Epée\nDégâts : 71 - 107 Vitesse 3.60\n(24.72 dégâts par seconde)\nDurabilité 100 / 100\nNiveau 25 requis\n[q2]Chances quand vous touchez : Pulvérise tous les ennemis devant vous avec de l’eau sous pression.\n[q2]Équipé : Augmente de 1 % les chances de toucher avec tous les sorts et attaques.\n[q]\"Le son des vagues qui s’écrasent résonne à chaque coup.\""},
[204809] = {name = "[q2]Rune de tonnerre furieux", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Grave sur votre pantalon la rune Tonnerre furieux :\n\n\nThunder Clap now increases the time between attacks by an additional 6%, can be used in any stance, deals 100% increased damage, and deals 50% increased threat.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[204864] = {name = "[q2]Notes d’apprenti Azora", additional_info = "Lié quand ramassé\nUnique (6)\n[q2]Utilise: Combine 6 notes d’apprenti Azora pour créer une nouvelle recette de gravure."},
[204905] = {name = "Tome inquiétant", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Invocation de Soboz\n[q]\"Apportez la mâchoire d’un loup et le sang d’un gnoll dans le ventre de l’agneau. Puis commencez l’incantation.\""},
[204906] = {name = "Sang de gnoll", additional_info = "Unique\n[q]\"Un réactif destiné à être utilisé lors d’un rituel d’invocation.\""},
[204907] = {name = "Mâchoire de loup", additional_info = "Unique\n[q]\"Un réactif destiné à être utilisé lors d’un rituel d’invocation.\""},
[204910] = {name = "[q0]Monstre – Trident, Naga (Or)", additional_info = "Lié quand ramassé\nDeux mains Armes d'hast\nDégâts : 2 - 4 Vitesse 3.00\n(1.00 dégâts par seconde)\nDurabilité 20 / 20"},
[204912] = {name = "[q2]Rune de Grâce", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur votre pantalon la rune Grâce démoniaque :\n\n\nVous surcharge d’énergie gangrenée, augmentant les chances d’esquive de votre familier et les vôtres de 30 %, et vos chances de coup critique avec toutes les attaques de 30 %. Dure 6 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[205019] = {name = "Fragment d’âme impure", additional_info = "Lié quand ramassé\nUnique"},
[205020] = {name = "Fragment d’âme pure", additional_info = "Lié quand ramassé\nUnique"},
[205022] = {name = "[q2]Rune de Siphon d’âme", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur votre poitrine ou votre robe la rune Siphon d’âme :\n\n\nAugmente le montant de points drainé par vos sorts Drain de vie et Drain d’âme de 6 % supplémentaires pour chacun de vos effets d’ombre sur la cible, jusqu’à un maximum de 18 % d’effet supplémentaire.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[205181] = {name = "Artéfact non identifié", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un objet magique ésotérique. Un démoniste plus expérimenté pourrait probablement vous en dire plus.\""},
[205182] = {name = "Artéfact déchargé", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Offre votre sang pour alimenter l’artéfact."},
[205183] = {name = "Artéfact alimenté par la corruption", additional_info = "Lié quand ramassé\nUnique"},
[205184] = {name = "Note d’acolyte", additional_info = "Lié quand ramassé\nUnique\n[q2]<Clique Droit pour Lire>"},
[205215] = {name = "[q2]Rune de Tactiques", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur votre poitrine ou votre robe la rune Tactique démoniaque :\n\n\nAugmente de 10% les chances de coup critique en mêlée ou avec les sorts pour votre familier et vous.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[205218] = {name = "[q2]Libram de découverte", additional_info = "Lié quand ramassé\nUniqueRelique Libram\nClasses : Paladin\nNiveau 5 requis\n[q2]Grave sur votre poitrine ou votre robe la rune Siphon d’âme :\n\n\nAugmente le montant de points drainé par vos sorts Drain de vie et Drain d’âme de 6 % supplémentaires pour chacun de vos effets d’ombre sur la cible, jusqu’à un maximum de 18 % d’effet supplémentaire.\n[q]\"Atteignez un état d’inspiration en tuant 5 ennemis, puis utilisez-le pour apprendre une nouvelle capacité.\""},
[205228] = {name = "[q2]Rune de Trait du chaos", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur vos gants la rune Trait du chaos :\n\n\nLance un éclair de feu chaotique sur l’adversaire et inflige de [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 522 / 100] à [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 662 / 100] points de dégâts de feu. Trait du chaos touche toujours sa cible, la cible ne peut pas y résister et sa connaissance permet à tous vos sorts de feu de traverser les effets d’absorption. Les monstres qui ont 4 niveaux ou plus que vous ont une forte chance de résister à Trait du chaos.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[205230] = {name = "[q2]Rune cauchemardesque", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur vos gants la rune Hanter :\n\n\nVous envoyez une âme fantomatique à l’intérieur de la cible, ce qui lui inflige de [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 251 / 100] à [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 295 / 100] points de dégâts d’ombre et augmente tous les dégâts infligés par vos effets de dégâts d’ombre sur la durée de 20 %. Quand le sort Hanter prend fin ou est dissipé, vous recevez des soins pour tous les dégâts infligés à la cible.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[205364] = {name = "Fourre-tout d’acolyte", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]<Clic Droit pour Ouvrir>"},
[205420] = {name = "[q2]Libram de jugement", additional_info = "Lié quand ramassé\nUniqueRelique Libram\nClasses : Paladin\n[q2]Grave sur vos gants la rune Frappe du croisé :\n\n\nAn instant strike that causes 75% weapon damage as Holy and regenerates 5% of your maximum mana.\n[q]\"Permet d’acquérir une nouvelle capacité après avoir jugé 10 ennemis.\""},
[205683] = {name = "[q2]Rune de Réprimandes", additional_info = "Lié quand ramassé\nUniqueClasses : Paladin\n[q2]Grave sur votre pantalon la rune\n Réprimandes :\n\n\nInterrompt l’incantation de sort et empêche tout sort de la même école de magie d’être lancé pendant 3 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[205685] = {name = "[q2]Rune d’Égide", additional_info = "Lié quand ramassé\nUniqueClasses : Paladin\n[q2]Grave sur votre poitrine la rune Egide :\n\n\nAugmente votre valeur de blocage de 30 % et les attaques en mêlée et à distance contre vous qui infligent des dégâts ont 10 % de chances d’augmenter vos chances de blocage de 30 %. Dure 10 sec ou bloque 5 attaques. Effet non cumulable avec Redoute.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[205863] = {name = "Libram corrompu", additional_info = "Classes : Paladin"},
[205864] = {name = "Note calcinée", additional_info = "Lié quand ramassé\nUniqueClasses : Paladin\n[q2]<Clique Droit pour Lire>"},
[205897] = {name = "[q2]Rune de Martyre", additional_info = "Lié quand ramassé\nUniqueClasses : Paladin\n[q2]Grave sur votre poitrine la rune Sceau du martyr :\n\n\nFills you with holy spirit for 30 sec, causing each of your melee attacks to deal 50% weapon damage to your target, but you lose health equal to 10% of the damage inflicted. While this seal is active, your party and raid members within 40 yards each gain mana equal to 20% of damage you take from this seal.\n\n Unleashing this Seal's energy will judge an enemy, instantly causing 85% weapon damage at the cost of health equal to 10% of the damage inflicted.\n\n This ability's Seal and Judgement benefit from talents and effects that modify the Seal or Judgement of Seal of Righteousness.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[205905] = {name = "[q2]Souvenir d’un champion dévoué", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur votre poitrine ou votre robe la rune Foi distordue :\n\n\nFouet mental et Attaque mentale infligent 50 % de dégâts supplémentaires sur les cibles affectées par votre Mot de l’ombre : Douleur.\n[q2]Utilise: Permet de se concentrer sur le souvenir pour apprendre un nouveau sort. Nécessite d’avoir fait le vide dans son esprit en méditant sur les mystères spirituels d’Azeroth."},
[205932] = {name = "[q2]Prophétie de la chute d’un roi", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur vos gants la rune Mot de l’ombre : Mort :\n\n\nUn mot de lien des ténèbres qui inflige de [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 320 / 100] à [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 372 / 100] points de dégâts d’ombre à la cible. Si la cible n’est pas tuée par Mot de l’ombre : Mort, le lanceur ou la lanceuse subit 50 % des dégâts infligés à la cible.\n[q2]Utilise: Permet de se concentrer sur la prophétie pour apprendre un nouveau sort. Nécessite d’avoir l’esprit concentré en ayant médité sur deux mystères spirituels d’Azeroth."},
[205940] = {name = "[q2]Souvenir d’un noir dessein", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur votre poitrine ou votre robe la rune Fléau du Vide :\n\n\nLa cible contracte une maladie qui lui inflige [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 129 / 100 * 6] points de dégâts d’Ombre en 18 sec.\n[q2]Utilise: Permet de se concentrer sur le souvenir pour apprendre un nouveau sort. Nécessite d’avoir fait le vide dans son esprit en méditant sur les mystères spirituels d’Azeroth."},
[205942] = {name = "Épiphanie chimérique", additional_info = "[q2]Grave sur votre pantalon la rune Prière de guérison :\n\n\nPlace sur la cible un sort qui lui rend [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100] points de vie la prochaine fois qu’elle subit des dégâts. Chaque fois que les soins sont déclenchés, la Prière de guérison passe à une autre cible du groupe ou raid se trouvant à moins de 20 mètres. Change de cible 5 fois au maximum et dure 30 sec après chaque changement. Ce sort ne peut être placé que sur une cible à la fois."},
[205943] = {name = "Prophétie d’une citadelle profanée", additional_info = "Unique\n[q2]Grave sur votre pantalon la rune Homoncules :\n\n\nVous arrachez des fragments de votre âme pour animer 3 versions miniatures de vous-même, qui tentent d’attaquer la cible actuelle avec une masse, une épée et une hache, réduisant respectivement la vitesse d’attaque, la puissance d’attaque et l’Armure de toute cible touchée.\n[q2]Utilise: Permet de se concentrer sur la prophétie pour apprendre un nouveau sort. Nécessite d’avoir l’esprit concentré en ayant médité sur deux mystères spirituels d’Azeroth."},
[205944] = {name = "[q2]Épiphanie réciproque", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur votre pantalon la rune Prière de guérison :\n\n\nPlace sur la cible un sort qui lui rend [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100] points de vie la prochaine fois qu’elle subit des dégâts. Chaque fois que les soins sont déclenchés, la Prière de guérison passe à une autre cible du groupe ou raid se trouvant à moins de 20 mètres. Change de cible 5 fois au maximum et dure 30 sec après chaque changement. Ce sort ne peut être placé que sur une cible à la fois.\n[q]\"Permet d’apprendre une nouvelle technique de gravure.\""},
[205945] = {name = "[q2]Souvenir d’un sauveur en captivité", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur votre pantalon la rune Souffrance partagée :\n\n\nVotre Mot de l’ombre : Douleur touche également jusqu’à 2 cibles supplémentaires se trouvant à moins de 15 mètres.\n[q2]Utilise: Permet de se concentrer sur le souvenir pour apprendre un nouveau sort. Nécessite d’avoir fait le vide dans son esprit en méditant sur les mystères spirituels d’Azeroth."},
[205946] = {name = "[q2]Souvenir de la trahison d’un dirigeant", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur vos bottes la rune Suppression de la douleur :\n\n\nRéduit instantanément les dégâts subis par une cible alliée de 40 % et augmente la résistance aux mécanismes de dissipation de 65 % pendant 8 sec.\n[q2]Utilise: Permet de se concentrer sur le souvenir pour apprendre un nouveau sort. Nécessite d’avoir fait le vide dans son esprit en méditant sur les mystères spirituels d’Azeroth."},
[205947] = {name = "[q2]Prophétie d’une citadelle profanée", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur votre pantalon la rune Homoncules :\n\n\nVous arrachez des fragments de votre âme pour animer 3 versions miniatures de vous-même, qui tentent d’attaquer la cible actuelle avec une masse, une épée et une hache, réduisant respectivement la vitesse d’attaque, la puissance d’attaque et l’Armure de toute cible touchée.\n[q2]Utilise: Permet de se concentrer sur la prophétie pour apprendre un nouveau sort. Nécessite d’avoir l’esprit concentré en ayant médité sur deux mystères spirituels d’Azeroth."},
[205948] = {name = "Épiphanie anodine", additional_info = nil},
[205949] = {name = "Épiphanie multiple", additional_info = "[q2]Grave sur vos gants la rune Cercle de soins :\n\n\nRend de [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 130 / 100] à [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 144 / 100] points de vie aux membres du groupe du personnage-joueur ciblé à moins de 40 m de lui."},
[205950] = {name = "[q2]Épiphanie ténébreuse", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur vos gants la rune Incandescence mentale :\n\n\nProvoque une explosion de magie des ombres autour de la cible ennemie et inflige [78 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] à [70 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] points de dégâts d’ombre toutes les 1 s. pendant 5 sec à tous les ennemis se trouvant à moins de 10 m de la cible.\n[q]\"Permet d’apprendre une nouvelle technique de gravure.\""},
[205951] = {name = "[q2]Souvenir d’un acolyte tourmenté", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur vos gants la rune Pénitence :\n\n\nLance une salve de lumière sacrée sur la cible et inflige [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 128 / 100] points de dégâts du sacré à un ennemi ou rend [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 85 / 100] points de vie à un allié instantanément et toutes les 1 s pendant 2 sec.\n[q2]Utilise: Permet de se concentrer sur le souvenir pour apprendre un nouveau sort. Nécessite d’avoir fait le vide dans son esprit en méditant sur les mystères spirituels d’Azeroth."},
[205952] = {name = "Souvenir d’un monde brisé", additional_info = "[q2]Utilise: Permet de se concentrer sur le souvenir pour apprendre un nouveau sort. Nécessite d’avoir fait le vide dans son esprit en méditant sur les mystères spirituels d’Azeroth."},
[205953] = {name = "[q2]Prophétie d’un vœu brisé", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur votre ceinture la rune Pointe mentale :\n\n\nFrappe la cible, lui inflige de [122 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] à [142 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] points de dégâts de givre-ombre, et augmente les chances de coup critique de votre prochaine Attaque mentale contre la cible de 30 %. Cumulable jusqu’à 3 fois.\n[q2]Utilise: Permet de se concentrer sur la prophétie pour apprendre un nouveau sort. Nécessite d’avoir l’esprit concentré en ayant médité sur deux mystères spirituels d’Azeroth."},
[205961] = {name = "Viande d’oiseau de Mulgore", additional_info = "Unique\n[q2]Utilise: Place un appât près d’une tanière de félin des montagnes."},
[205979] = {name = "[q2]Rune de Contournement", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur votre pantalon la rune Frappe latérale :\n\n\nVotre familier et vous infligez simultanément 100 % de vos dégâts de mêlée instantanément. Ensuite, votre Morsure de mangouste et votre Attaque du raptor infligent 10 % de dégâts supplémentaires pendant 10 sec, cumulables jusqu’à 3 fois. Attaque du raptor a 20 % de chances de mettre fin au temps de recharge de Frappe latérale.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[205995] = {name = "Musc de chien de prairie", additional_info = "Classes : Chasseur\n[q2]Utilise: Apprivoiser une bête fonctionne aussi sur les chiens de prairie (comme mascotte). (10 Min Recharge)"},
[206032] = {name = "[q2]Rune de Découpe", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur vos gants la rune Écharper :\n\n\nUne attaque circulaire qui frappe tous les ennemis en face de vous pour 65 % des dégâts de l’arme.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[206155] = {name = "[q2]Rune de visée", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur votre poitrine ou votre robe la rune Maître tireur :\n\n\nAugmente vos chances de coup critique de 5 % et réduit le coût en mana de toutes vos techniques de tir de 25 %.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[206157] = {name = "Charge d’hydroglycérine excavatrice", additional_info = "Objet de quête\nUnique (5)"},
[206159] = {name = "Déguisement de la KapitalRisk", additional_info = "Objet de quête\n[q]\"Cela ne ressemble pas vraiment à un déguisement…\""},
[206168] = {name = "[q2]Rune de la chimère", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur vos gants la rune Tir de la chimère :\n\n\nInfligez 120 % des dégâts de l’arme, réinitialise la piqûre ou morsure actuelle sur la cible et déclenche un effet :\n\n Morsure de serpent – Inflige instantanément 48 % des dégâts de Morsure de serpent.\n\n Morsure de vipère – Rend instantanément un montant de mana égal à 60 % du total drainé par Morsure de vipère.\n\n Piqûre de scorpide – Tente de désarmer la cible pendant 10 sec. Cet effet ne peut se produire plus d’une fois par minute.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[206169] = {name = "[q2]Rune de Tir explosif", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur vos gants la rune Tir explosif :\n\n\nVous lancez une charge explosive sur la cible, infligeant [Ranged attack power * 0.039 + 41 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] à [Ranged attack power * 0.039 + 63 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] points de dégâts de feu à l’ensemble des adversaires à moins de 8 mètres. La charge inflige à nouveau des dégâts toutes les secondes pendant 2 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[206170] = {name = "Cône de Furie-des-vents", additional_info = "Objet de quête"},
[206175] = {name = "Onguent de pin", additional_info = "Objet de quête\nUnique"},
[206176] = {name = "Mortier et pilon", additional_info = "Objet de quête\nUnique\n[q2]Utilise: Broie 8 cônes de Furie-des-vents pour créer un onguent d’arme venimeux. En théorie."},
[206177] = {name = "Beurre de pignons de pin", additional_info = "Lié quand ramassé\n[q2]Utilise: Rend 61.2 points de vie en 18 sec. Si vous passez au moins 10 secondes à manger, vous serez \"bien nourri\" et vous bénéficierez d'un bonus de 2 à l'Endurance et à l'Esprit pendant 15 min. Vous devez rester assis pendant que vous mangez."},
[206264] = {name = "[q2]Rune d’Inspiration", additional_info = "Lié quand ramassé\nUniqueClasses : Paladin\n[q2]Grave sur votre pantalon la rune Source d’inspiration :\n\n\nVotre présence inspirante dissipe périodiquement les effets de peur et de sommeil sur les membres du groupe proches.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[206344] = {name = "Ensemble de couteaux", additional_info = "Objet de quête\nUnique\n[q2]Utilise: Tentez de lever les filets d’un goujon brillant cru."},
[206345] = {name = "Morceaux de poissons", additional_info = "Objet de quête\nUnique"},
[206376] = {name = "[q2]Icône de barricade", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\nNiveau 3 requis\n[q2]Grave sur votre poitrine ou votre robe la rune bouclier Maîtrise du bouclier :\n\n\nChaque fois que vous bloquez, vous régénérez un montant de mana égal à 8 % de votre maximum et votre Armure est augmentée de 30 % de la valeur d’Armure de votre bouclier, cumulable jusqu’à 5 fois. Vous gagnez également 10 % de chances de bloquer et 15 % de valeur de blocage en permanence.\n[q]\"Permet d’acquérir une nouvelle capacité après avoir frappé des ennemis 25 fois avec l’enchantement d’arme Croque-roc.\""},
[206381] = {name = "[q2]Icône dyadique", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\nNiveau 3 requis\n[q2]Grave sur votre poitrine ou votre robe la rune Surcharge :\n\n\nDonne à vos sorts Éclair, Chaîne d’éclairs, Salve de guérison, Vague de soins et Explosion de lave 50 % de chances de lancer un second sort semblable sur la même cible sans coût supplémentaire. Ce sort inflige la moitié des dégâts et ne génère pas de menace.\n[q]\"Permet d’acquérir une nouvelle capacité avoir reçu des dégâts de nature 10 fois.\""},
[206382] = {name = "[q2]Icône de tempête", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\nNiveau 20 requis\n[q2]Grave sur vos gants la rune Bouclier d’eau :\n\n\nLe lanceur ou la lanceuse s’entoure de 3 globes d’eau, ce qui rend 1 % du maximum de mana toutes les 5 s. À toute attaque en mêlée ou à distance ou à tout sort subis, rend 4 % du maximum de mana. Un globe d’eau est alors dépensé. Un seul globe peut s’activer toutes les quelques secondes. Dure 10 min. Un seul Bouclier élémentaire peut être actif sur le chaman à la fois.\n[q]\"Permet d’acquérir une nouvelle capacité après avoir frappé 10 personnages non-joueurs avec 3 éléments différents (nature, givre, feu).\""},
[206383] = {name = "[q2]Icône lithique", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\nNiveau 3 requis\n[q2]Grave sur votre pantalon la rune Bouclier de terre :\n\n\nProtects the target with an earthen shield, reducing casting or channeling time lost when damaged by 30% Â and causing attacks to heal the shielded target for [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100]. Â This effect can only occur once every few seconds. Â 9 charges. Lasts 10 min. Â Earth Shield can only be placed on one target at a time and only one Elemental Shield can be active on a target at a time.\n[q]\"Permet d’acquérir une nouvelle capacité après avoir bloqué 20 attaques avec votre bouclier.\""},
[206384] = {name = "[q2]Icône astrale", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\nNiveau 3 requis\n[q]\"Permet d’acquérir une nouvelle capacité après avoir frappé des ennemis 25 fois avec l’enchantement d’arme Croque-roc.\""},
[206385] = {name = "[q2]Icône clastique", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\nNiveau 3 requis\n[q2]Grave sur votre pantalon la rune Voie de la terre :\n\n\nTant qu’Arme Croque-roc est active sur votre arme principale, vous générez 50 % de menace supplémentaire, vous gagnez 30 % de points de vie, vous subissez des dégâts réduits de 10 %, réduit la probabilité que vous soyez touché par un coup critique infligé par une attaque en mêlée de 6 % et Horion de terre provoque les cibles pour qu’elles vous attaquent avec un temps de recharge distinct des autres horions, mais sa portée est réduite à la mêlée.\n[q]\"Permet d’acquérir une nouvelle capacité après avoir vaincu 20 ennemis à l’aide du sort Horion de terre.\""},
[206386] = {name = "[q2]Icône galvanique", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\nNiveau 3 requis\n[q2]Grave sur votre poitrine ou votre robe la rune bouclier Maîtrise du bouclier :\n\n\nChaque fois que vous bloquez, vous régénérez un montant de mana égal à 8 % de votre maximum et votre Armure est augmentée de 30 % de la valeur d’Armure de votre bouclier, cumulable jusqu’à 5 fois. Vous gagnez également 10 % de chances de bloquer et 15 % de valeur de blocage en permanence.\n[q]\"Permet d’acquérir une nouvelle capacité après avoir vaincu 10 ennemis à l’aide du sort Éclair.\""},
[206387] = {name = "[q2]Icône kajarique", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\n[q2]Grave sur vos gants la rune Explosion de lave :\n\n\nVous lancez de la lave en fusion sur la cible, lui infligeant [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] à [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] points de dégâts de feu. Si Horion de flammes est actif sur la cible, Explosion de lave sera un coup critique.\n[q]\"Permet d’acquérir une nouvelle capacité après avoir subi 5 fois des dégâts de lave. (Réduit les dégâts dus à certaines sources de lave.)\""},
[206388] = {name = "[q2]Icône sulfureuse", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\nNiveau 3 requis\n[q2]Grave sur vos gants la rune Éclair de lave :\n\n\nJusqu’à 4 adversaires dans un cône devant vous subissent [(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 72 / 100 + 5 / 100 * Attack power] à [(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 108 / 100 + 5 / 100 * Attack power] points de dégâts de feu. Cette technique génère une menace élevée. Les dégâts périodiques de Horion de flammes ont 10 % de chances de mettre fin au temps de recharge d’Éclair de lave.\n[q]\"Permet d’acquérir une nouvelle capacité après avoir vaincu 10 ennemis à l’aide du sort Horion de terre.\""},
[206389] = {name = "[q2]Icône de soufre", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\nNiveau 3 requis\n[q2]Grave sur votre ceinture la rune Nova de feu :\n\n\nTotem Nova de feu est remplacé par Nova de feu, qui permet à votre totem de feu actuel d’infliger des dégâts autour de son emplacement.\n[q]\"Permet d’acquérir une nouvelle capacité après avoir frappé des ennemis 25 fois avec l’enchantement d’arme Croque-roc.\""},
[206390] = {name = "[q2]Icône ichthyane", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\nNiveau 3 requis\n[q2]Grave sur vos gants la rune Bouclier d’eau :\n\n\nLe lanceur ou la lanceuse s’entoure de 3 globes d’eau, ce qui rend 1 % du maximum de mana toutes les 5 s. À toute attaque en mêlée ou à distance ou à tout sort subis, rend 4 % du maximum de mana. Un globe d’eau est alors dépensé. Un seul globe peut s’activer toutes les quelques secondes. Dure 10 min. Un seul Bouclier élémentaire peut être actif sur le chaman à la fois.\n[q]\"Permet d’acquérir une nouvelle capacité après avoir frappé des ennemis 25 fois avec l’enchantement d’arme Croque-roc.\""},
[206391] = {name = "[q2]Icône syzygique", additional_info = "Lié quand ramassé\nUniqueRelique Totem\nClasses : Chaman\nNiveau 3 requis\n[q]\"Permet d’acquérir une nouvelle capacité après avoir frappé des ennemis 25 fois avec l’enchantement d’arme Croque-roc.\""},
[206466] = {name = "Couronne de prairie", additional_info = "[q2]Utilise: Réveille un esprit des plaines."},
[206469] = {name = "Fleur de prairie", additional_info = "Classes : Druide\n[q2]Utilise: Combine 3 fleurs de la prairie pour faire une couronne."},
[206954] = {name = "[q2]Idole de la rage ursine", additional_info = "Lié quand ramassé\nUniqueRelique Idole\nClasses : Druide\nNiveau 10 requis\n[q2]Grave sur vos gants la rune Mutilation :\n\n\nMutile la cible, ce qui lui inflige 160 % des dégâts normaux. De plus, les effets de saignement et Lambeau lui infligent 30 % de dégâts supplémentaires pendant 1 min. Cette technique bénéficie de tous les effets associés à Griffe et Mutiler et les déclenche.\n[q]\"Permet d’acquérir une nouvelle capacité après avoir maintenu votre rage en forme d’ours à 50 ou plus pendant 60 secondes\""},
[206963] = {name = "[q2]Rune de potentiel naturel", additional_info = "Lié quand ramassé\nUniqueClasses : Druide\n[q2]Grave sur votre poitrine ou votre robe la rune Graine de vie :\n\n\nQuand vous réussissez des soins critiques avec un sort de soins, vous plantez une Graine de vie sur la cible pour un montant égal à 50 % des points de vie rendus. La Graine de vie fleurira la prochaine fois que la cible subira des dégâts ou recevra des soins non périodiques. Dure 15 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[206966] = {name = "Bulbe de satyrienne", additional_info = "Lié quand ramassé\nUnique\n[q]\"La bouture d’une espèce végétale invasive.\""},
[206970] = {name = "[q2]Rune de vie", additional_info = "Lié quand ramassé\nUniqueClasses : Druide\n[q2]Grave sur votre pantalon la rune Fleur de vie :\n\nRéduit le temps de recharge global de vos techniques Récupération et Fleur de vie de 0.5,1 s et vous obtenez la technique Fleur de vie :\n\n\nRend [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] points de vie à la cible en 7 sec. Quand Fleur de vie parvient au terme de sa durée ou est dissipée, la cible reçoit instantanément [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] points de vie et le lanceur ou la lanceuse récupère la moitié du coût du sort. Cet effet est cumulable jusqu’à 3 fois sur la même cible.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[206975] = {name = "Clé de l’entrepôt d’artéfact", additional_info = "Unique\n[q]\"Ouvre le coffre de l’entrepôt d’artéfact.\""},
[206985] = {name = "[q2]Écho de l’alpha", additional_info = "Lié quand ramassé\nUniqueClasses : Chaman\nNiveau 3 requis\n[q2]Grave sur vos bottes la rune Esprit de l’alpha :\n\n\nInfuses the target with the spirit of an alpha wolf, increasing all threat generated by the target by 45% for 30 min. Limit 1 target. If cast on a target other than self, the Shaman also gains Loyal Beta, increasing Attack Power by 20% for 30 min. A target cannot have both Spirit of the Alpha and Loyal Beta at the same time.\n[q]\"Permet d’acquérir une nouvelle capacité.\""},
[206989] = {name = "[q2]Rune du soleil", additional_info = "Lié quand ramassé\nUniqueClasses : Druide\n[q2]Grave sur vos gants la rune Éclat solaire :\n\n\nBrûle l’ennemi et lui inflige [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] à [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] points de dégâts de nature puis [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] points de dégâts de nature supplémentaires en 12 sec.\n\n De plus, lorsque vous êtes en forme d’ours, de félin ou d’ours redoutable, votre Éclat lunaire est remplacé par Éclat solaire (ours) ou Éclat solaire (félin). Ce sort bénéficie et déclenche tous les effets associés à Éclat lunaire.\n\n Éclat solaire (ours)\nBrûle l’ennemi et lui inflige [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] à [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] points de dégâts de nature puis [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] points de dégâts de nature supplémentaires en 12 sec.\n\n Éclat solaire (félin)\nBrûle l’ennemi et lui inflige [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] à [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] points de dégâts de nature puis [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] points de dégâts de nature supplémentaires en 12 sec. Octroie 1 point de combo.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[206992] = {name = "[q2]Rune de Coup de crâne", additional_info = "Lié quand ramassé\nUniqueClasses : Druide\n[q2]Grave sur votre pantalon la rune Coup de crâne :\n\n\nVous chargez une cible jusqu’à 13 m et lui fracassez le crâne, ce qui interrompt son incantation et l’empêche de lancer tout sort de la même école pendant 2 sec. Partage le temps de recharge de Charge farouche.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[206994] = {name = "Tête de huran coupée", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un trophée sinistre. Peut intéresser le bon collectionneur…\""},
[206995] = {name = "Tête de harpie coupée", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un trophée sinistre. Peut intéresser le bon collectionneur…\""},
[207062] = {name = "Tête de centaure coupée", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un trophée sinistre. Peut intéresser le bon collectionneur…\""},
[207098] = {name = "Note de Ba’so", additional_info = "Lié quand ramassé\nClasses : Voleur\n[q]\"Un message écrit dans la langue des voleurs.\"\n[q2]<Clique Droit pour Lire>\nDépouillé sur: Fizzle Darkstorm\nChance de Butin: 0.02%"},
[207106] = {name = "Morceau inférieur gauche de carte", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Combiner avec 3 autres morceaux pour former la carte complète.\n[q]\"Un morceau déchiré de ce qui semble être une carte…\""},
[207107] = {name = "Morceau inférieur droit de carte", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Combiner avec 3 autres morceaux pour former la carte complète.\n[q]\"Un morceau déchiré de ce qui semble être une carte…\""},
[207108] = {name = "Morceau supérieur gauche de carte", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Combiner avec 3 autres morceaux pour former la carte complète.\n[q]\"Un morceau déchiré de ce qui semble être une carte…\""},
[207109] = {name = "Morceau supérieur droit de carte", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Combiner avec 3 autres morceaux pour former la carte complète.\n[q]\"Un morceau déchiré de ce qui semble être une carte…\""},
[207110] = {name = "Carte au trésor de Durotar", additional_info = "Lié quand ramassé\nClasses : Voleur\n[q2]Utilise: Exhume un trésor à l’endroit indiqué. (1 Min Recharge)\n[q]\"En face de la tête de singe sur l’île de l’Écho la plus au sud.\""},
[207590] = {name = "Viande de cochon de Durotar", additional_info = "Unique\n[q2]Utilise: Place un appât dans une tanière de félin insulaire."},
[207631] = {name = "Phéromone d’aspic", additional_info = "Classes : Chasseur\n[q2]Utilise: Votre compétence Apprivoiser une bête fonctionne aussi sur les aspics (comme animal de compagnie). (10 Min Recharge)"},
[207731] = {name = "Tome inquiétant", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Invocation de Soboz\n[q]\"Apportez une patte de makrura et le crâne d’un humain de Kul Tiras sur la plus grande île de l’Écho. Trouvez le cercle de pouvoir et accomplissez le rituel.\""},
[207732] = {name = "Patte de makrura", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un réactif destiné à être utilisé lors d’un rituel d’invocation.\""},
[207733] = {name = "Crâne de Kul Tiras", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un réactif destiné à être utilisé lors d’un rituel d’invocation.\""},
[207972] = {name = "Les leçons de Ta’zo", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un tracé de gravures écrites par un grand mage troll ou une grande mage trolle. Un ouvrage de choix pour toute bibliothèque qui se respecte.\""},
[207973] = {name = "Mâchoire de molosse", additional_info = "Unique"},
[207974] = {name = "Tome inquiétant", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Invocation de Soboz\n[q]\"Apportez la mâchoire d’un molosse et le sang d’un gnoll dans les égouts. Puis commencez l’incantation.\""},
