[208185] = {name = "L’abécédaire métaphysique de l’apothicaire", additional_info = "Unique\n[q]\"Des notes élémentaires sur la théorie des arcanes et la recherche sur les sorts, compilées par l’archimage Mèche-pourrie de la Société royale des apothicaires. Un ouvrage de choix pour toute bibliothèque qui se respecte.\""},
