[208414] = {name = "[q2]Idole lunaire", additional_info = "Lié quand ramassé\nUniqueRelique Idole\nClasses : Druide\nNiveau 4 requis\n[q2]Grave sur votre poitrine ou votre robe la rune Fureur de Hurlorage :\n\n\nRéduit de 100 % le coût en mana de Courroux et chaque fois que vous infligez des dégâts avec Courroux, vous avez 12 % de chances que votre prochaine incantation de Toucher guérisseur dans les 15 sec soit instantanée et utilisable sous n’importe quelle forme.\n[q]\"Terrassez 6 créatures affectées par votre sort Éclat lunaire, puis utilisez cette idole pour apprendre une nouvelle capacité.\""},
