[208611] = {name = "Tête de tigre coupée", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un trophée sinistre. Peut intéresser le bon collectionneur…\""},
[208612] = {name = "Tête d’araignée coupée", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un trophée sinistre. Peut intéresser le bon collectionneur…\""},
[208682] = {name = "Œuf abandonné de gueule d’acier", additional_info = "Lié quand ramassé\nUniqueClasses : Druide\n[q]\"A besoin d’un nouveau foyer.\""},
[208687] = {name = "[q2]Rune de Lacérer", additional_info = "Lié quand ramassé\nUniqueClasses : Druide\n[q2]Grave sur vos gants la rune\n Lacérer :\n\n\nLacère la cible, ce qui la fait saigner de [(9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) * 20 / 100 * 5] points de dégâts en 15 sec plus 20 % des dégâts de l’arme par application existante de Lacérer sur la cible. Génère une quantité de menace élevée. Cet effet se cumule jusqu’à 5 fois sur la même cible.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[208689] = {name = "[q2]Idole féroce", additional_info = "Lié quand ramassé\nUniqueRelique Idole\nClasses : Druide\nNiveau 20 requis\n[q2]Grave sur votre pantalon la rune Rugissement sauvage :\n\n\nCoup de grâce qui augmente les dégâts physiques infligés de 30 % en forme de félin. La durée dépend du nombre de points de combo :\n 1 point : 14 s\n 2 points : 19 s\n 3 points : 24 s\n 4 points : 29 s\n 5 points : 34 s\n[q]\"Infligez 20 dégâts de saignement à des cibles humanoïdes, puis utilisez cette idole pour apprendre une nouvelle capacité.\""},
[208701] = {name = "[q2]Rune de Maîtrise des bêtes", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur vos gants la rune Maîtrise des bêtes :\n\n\nLes dégâts et points de vie de votre familier sont augmentés de 20 % et sa régénération de focalisation de 50 %. En outre, Grondement provoque également la cible pour qu’elle l’attaque pendant 3 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[208739] = {name = "Bannière de guerre de la Horde", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q]\"Plantez-la dans le sol de vos ennemis.\""},
[208741] = {name = "[q2]Rune de Rage infinie", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Grave sur vos gants la rune Rage infinie :\n\n\nVous générez 25 % de rage supplémentaires lorsque vous infligez des dégâts.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[208743] = {name = "Âme de cupidité", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste"},
[208744] = {name = "[q2]Rune des Traits d’ombre", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur vos gants la rune Salve de traits de l’ombre :\n\n\nVotre Trait de l’ombre touche désormais jusqu’à 5 cibles à une distance de chaîne de 10 m, mais inflige 20 % de dégâts en moins.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[208749] = {name = "Clé de cache pin-tordu", additional_info = "Unique\n[q]\"Une branche d’arbre est grossièrement sculptée sur la poignée.\""},
[208750] = {name = "[q2]Rune de Canalisation", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur votre poitrine ou votre robe la rune Maîtrise de la canalisation :\n\n\nVotre Drain de vie n’est plus canalisé, dure 15 sec avec un temps de recharge de 15 sec, coûte 100 % de mana supplémentaire et vous soigne de 50 % de plus chaque fois qu’il inflige des dégâts.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[208753] = {name = "[q2]Notes de sort : Régénération", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\n[q2]Grave sur votre poitrine ou votre robe la rune Régénération :\n\n\nRend à la cible [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] points de vie en 3 sec et applique Balise temporelle pendant 30 s.\n\n Balise temporelle\n\nEnregistre la position spatio-temporelle de la cible. 80 % de tous les dégâts des arcanes infligés par le lanceur ou la lanceuse seront convertis en soins chronomantiques pour chaque cible actuelle de Balise temporelle du lanceur ou de la lanceuse. Ces soins sont réduits de 50 % sur vous-même, et également réduits de 80 % lorsque les dégâts sont infligés par des sorts des arcanes qui blessent plusieurs cibles.\n[q]\"Teaches you a new Engraving ability.\""},
[208754] = {name = "[q2]Notes de sort : NIGÉO NÉRÉRAT", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\n[q2]Utilise: Déchiffre les notes de sort avec un charme de compréhension pour apprendre un nouveau sort de gravure."},
[208758] = {name = "[q2]Rune de terre", additional_info = "Lié quand ramassé\nUniqueClasses : Chaman\n[q2]Grave sur votre pantalon la rune Voie de la terre :\n\n\nTant qu’Arme Croque-roc est active sur votre arme principale, vous générez 50 % de menace supplémentaire, vous gagnez 30 % de points de vie, vous subissez des dégâts réduits de 10 %, réduit la probabilité que vous soyez touché par un coup critique infligé par une attaque en mêlée de 6 % et Horion de terre provoque les cibles pour qu’elles vous attaquent avec un temps de recharge distinct des autres horions, mais sa portée est réduite à la mêlée.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[208760] = {name = "Couronne de la clairière", additional_info = "[q2]Utilise: Réveille un esprit des plaines."},
[208764] = {name = "[q2]Rune de l’esprit", additional_info = "UniqueClasses : Prêtre\n[q2]Grave sur votre ceinture la rune Pointe mentale :\n\n\nFrappe la cible, lui inflige de [122 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] à [142 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] points de dégâts de givre-ombre, et augmente les chances de coup critique de votre prochaine Attaque mentale contre la cible de 30 %. Cumulable jusqu’à 3 fois."},
[208765] = {name = "[q2]Main secourable", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q]\"La main s’ouvrira à un sauveur.\""},
[208766] = {name = "[q2]Main secourable", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q]\"La main s’est ouverte pour vous.\"\n[q2]<Clic Droit pour Ouvrir>"},
[208767] = {name = "[q2]Rune de guérison", additional_info = "UniqueClasses : Prêtre\n[q2]Grave sur votre pantalon la rune Prière de guérison :\n\n\nPlace sur la cible un sort qui lui rend [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100] points de vie la prochaine fois qu’elle subit des dégâts. Chaque fois que les soins sont déclenchés, la Prière de guérison passe à une autre cible du groupe ou raid se trouvant à moins de 20 mètres. Change de cible 5 fois au maximum et dure 30 sec après chaque changement. Ce sort ne peut être placé que sur une cible à la fois.\n[q]\"Vous apprend une nouvelle technique de gravure runique.\""},
[208768] = {name = "Boîte d’allumettes de boucanier", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q]\"Utilisée pour enflammer les matériaux inflammables.\""},
[208771] = {name = "[q2]Rune de Danse des lames", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur votre pantalon la rune Danse des lames :\n\n\nCoup de grâce qui augmente les chances de parade de 10 %. La durée dépend du nombre de points de combo :\n\n 1 point : 14 s\n 2 points : 18 s\n 3 points : 22 s\n 4 points : 26 s\n 5 points : 30 s\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[208772] = {name = "[q2]Rune de Coup de sabre", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur vos gants la rune Coup de sabre :\n\n\nTaille sauvagement un ennemi en infligeant 100 % des dégâts de l’arme et fait saigner la cible pour (Attack power * 5 / 100) points de dégâts toutes les 2 s pendant 12 sec, cumulable jusqu’à 3 fois. Octroie 1 point de combo.\n\n Coup de sabre bénéficie de tous les talents et effets qui se déclenchent à partir de ou modifient Attaque pernicieuse.\n[q]\"Vous apprend une nouvelle technique de gravure.\"\nDépouillé sur: Eclaireur défias\nChance de Butin: 4.76%"},
[208773] = {name = "Harpon de pêche", additional_info = "Lié quand ramassé\nClasses : Guerrier , Chasseur\n[q2]Utilise: Lance le harpon sur la cible (portée 40 m).\n[q]\"Un outil indispensable pour les chasseurs de requins en herbe !\""},
[208777] = {name = "[q2]Rune de tir de précision", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur votre pantalon la rune Entraînement de sniper :\n\n\nVos techniques de Tir gagnent 10 % de chances de coup critique supplémentaires lorsque vous n’avez pas bougé depuis 6 s.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[208778] = {name = "[q2]Rune de Frappe rapide", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Grave sur vos gants la rune Frappe rapide :\n\n\nUne attaque de mêlée instantanée et téméraire avec votre arme à deux mains, qui inflige (Attack power * 10 / 100) à (Attack power * 20 / 100) points de dégâts physiques. Cette technique bénéficie et déclenche tous les effets associés à Frappe héroïque.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[208799] = {name = "[q2]Notes de sort : Bombe vivante", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\n[q2]Grave sur vos gants la rune Bombe vivante :\n\n\nLa cible devient une bombe vivante qui inflige [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4] points de dégâts de feu en 12 sec. Au bout de 12 sec ou quand le sort est dissipé, la cible explose en infligeant [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100] points de dégâts de feu aux ennemis à moins de 10 mètres\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[208800] = {name = "Baxtan : Sur les magies destructrices", additional_info = "Unique\n[q]\"Les écrits d’un éminent mage gobelin ou d’une éminente mage gobeline. Un ouvrage de choix pour toute bibliothèque qui se respecte.\""},
[208823] = {name = "Pièce à offrandes", additional_info = "Lié quand ramassé\nClasses : Prêtre\n[q2]Utilise: Lancer dans un puits voisin pour faire un vœu."},
[208828] = {name = "Souvenir d’un vœu brisé", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur votre ceinture la rune Pointe mentale :\n\n\nFrappe la cible, lui inflige de [122 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] à [142 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] points de dégâts de givre-ombre, et augmente les chances de coup critique de votre prochaine Attaque mentale contre la cible de 30 %. Cumulable jusqu’à 3 fois.\n[q2]Utilise: Permet de se concentrer sur le souvenir pour apprendre un nouveau sort. Nécessite d’avoir fait le vide dans son esprit en méditant sur les mystères spirituels d’Azeroth."},
[208833] = {name = "Tarte malveillante", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q]\"Une pâtisserie dotée d’une énergie sinistre.\""},
[208838] = {name = "[q2]Coffret Sombrefer", additional_info = "Lié quand ramassé\nUnique\n[q0]Verrouillé\n Crochetage (1) requis"},
[208843] = {name = "Totem de bataille", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Utilise: Défier un Tauren en duel.\n[q]\"Un symbole d’hostilité parmi les membres de la Horde.\""},
[208847] = {name = "Géode en forme de crâne", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q]\"Il est possible de l’ouvrir en la frappant d’un coup sec.\""},
[208848] = {name = "Géode en forme de crâne fêlé", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q]\"La géode a été fendue.\"\n[q2]<Clic Droit pour Ouvrir>"},
[208849] = {name = "[q2]Libram des bénédictions", additional_info = "Lié quand ramassé\nUniqueRelique Libram\nClasses : Paladin\nNiveau 4 requis\n[q2]Grave sur votre poitrine la rune Cor de Lordaeron :\n\n\nLe paladin souffle dans le Cor de Lordaeron, ce qui augmente le total de Force et d’Agilité des membres du groupe dans un rayon de 30 mètres de 6. Dure 2 min. Incompatible avec Bénédiction de puissance.\n[q]\"Permet d’apprendre une nouvelle capacité après avoir accordé des bénédictions à 5 personnages-joueurs différents.\""},
[208851] = {name = "[q2]Libram de justice", additional_info = "Lié quand ramassé\nUniqueRelique Libram\nClasses : Paladin\nNiveau 8 requis\n[q2]Grave sur vos gants la rune Main de rétribution :\n\n\nProvoque la cible et la force à vous attaquer. Aucun effet si elle est déjà en train de vous attaquer.\n\n Pendant que vous connaissez cette technique, le bonus de menace de Fureur vertueuse passe à 80 % et Fureur vertueuse vous fait gagner du mana lorsque d’autres personnages vous soignent, pour 25 % du montant des soins. De plus, tant que Fureur vertueuse est actif, les dégâts qui vous font descendre sous 35 % de points de vie sont réduits de 20 %. Fureur vertueuse reste actif jusqu’à annulation.\n[q]\"Permet d’apprendre une nouvelle capacité après avoir tué 10 ennemis assommés par le sort Marteau de la justice.\""},
[208853] = {name = "[q2]Notes de sort : Gel mental", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\nGravure\n(1) requis\n[q2]Grave sur vos bottes la rune Gel mental :\n\n\nVos sorts de givre infligeant des dégâts et pouvant transir ont 15 % de chances de supprimer le temps d’incantation et le coût en mana de votre prochain sort Boule de feu, Trait givre-sort ou Éclair de givrefeu.\n[q]\"Vous apprend une nouvelle technique de gravure runique.\""},
[208854] = {name = "[q2]Notes de sort mâchonnées", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\n[q2]Utilise: Déchiffre les notes de sort avec un charme de compréhension pour apprendre un nouveau sort de gravure.\n[q]\"Les chamans troggs sont de véritables lecteurs voraces.\""},
