[209852] = {name = "[q2]Rune d’Ordre de tuer", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur votre pantalon la rune Ordre de tuer :\n\n\nDonne l’ordre de tuer. Les dégâts infligés par votre familier avec Griffe et Morsure sont augmentés de 60% pendant 30 sec. Chaque attaque Griffe ou Morsure effectuée par le familier réduit le bonus de dégâts de 20%.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
