[210137] = {name = "[q2]Rune de croissance sauvage", additional_info = "Lié quand ramassé\nUniqueClasses : Druide\n[q2]Grave sur vos gants la rune Croissance sauvage :\n\n\nRend [34 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] points de vie en 7 sec aux membres du groupe du personnage-joueur ciblé à moins de 40 m de lui. La quantité de soins prodiguée est importante au début, puis diminue à mesure que Croissance sauvage atteint sa durée maximale.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
