[210210] = {name = "[q0]Certificat du fondateur des Industries de défense Grisœuvre", additional_info = "[q]\"Les lignes en petits caractères expliquent clairement que ce certificat n’a aucune valeur marchande ni légale. En les masquant de votre pouce, vous pourriez réussir à le vendre.\""},
