[210229] = {name = "[q2]Idole de mutilation", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur vos gants la rune Estropier :\n\n\nAttaque instantanément avec les deux armes et inflige 100 % des dégâts des armes plus [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] avec chacune. Les dégâts sont augmentés de 20 % contre les cibles empoisonnées. Vous gagnez 2 points de combo.\n\n Estropier bénéficie de tous les talents et effets qui se déclenchent à partir de ou modifient Attaque sournoise, sauf indication contraire.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210250] = {name = "Anneau d’or ciselé", additional_info = "Lié quand ramassé\nUniqueDoigt\n[q]\"On y lit : Tout en __ les deux __ s’agenouiller __ la __ dans __ cimetière.\""},
[210251] = {name = "Anneau d’argent ciselé", additional_info = "Lié quand ramassé\nUniqueDoigt\n[q]\"On y lit : __ portant __ anneaux __ devant __ statue __ le __\""},
[210252] = {name = "[q2]Runes du surin", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur vos gants la rune Kriss :\n\n\nAttaque instantanément votre arme tenue en main gauche et inflige les dégâts normaux infligés avec la main gauche avec 100 % de chances d’appliquer le poison de votre arme. Les armes plus lentes nécessitent plus d’énergie. Octroie 1 point de combo.\n\n Kriss bénéficie de tous les talents et effets qui se déclenchent à partir de ou modifient Attaque pernicieuse.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210253] = {name = "[q2]Totem putride", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Fait appel aux esprits des éléments.\n[q]\"Un totem traditionnel… tordu et perverti par la magie noire, presque méconnaissable comparé aux totems en harmonie avec les éléments.\""},
[210322] = {name = "[q2]Rune de venin", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur votre pantalon la rune Envenimer :\n\n\nCoup de grâce qui inflige des dégâts de poison instantanément en fonction de vos doses de Poison mortel sur la cible. Après l’attaque Envenimer, vous avez 75 % de chances supplémentaires d’appliquer Poison instantané pendant 1 s plus 1 s supplémentaire par point de combo. Une dose est activée par point de combo :\n 1 dose : [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 1 + Attack power * 0.09] points de dégâts\n 2 doses : [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 2 + Attack power * 0.18] points de dégâts\n 3 doses : [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 3 + Attack power * 0.27] points de dégâts\n 4 doses : [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 4 + Attack power * 0.36] points de dégâts\n 5 doses : [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 5 + Attack power * 0.45] points de dégâts.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210323] = {name = "Combinaison du coffre", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q]\"0-4-5-1\""},
[210329] = {name = "Carte au trésor de Hautebrande", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q]\"Suivez la rivière vers le nord, au-delà des montagnes d’Alterac. Ce que vous cherchez se trouve sous les chutes de rapides.\""},
[210330] = {name = "Bon tuyau", additional_info = "Lié quand ramassé\nUnique\n[q]\"Une bonne information coûte cher.\"\n[q2]<Clic Droit pour Ouvrir>"},
[210410] = {name = "Appât à mordeuse d’eau douce", additional_info = "Classes : Chasseur\n[q2]Utilise: Lance un appât. (5 Min Recharge)\n[q]\"Jetez-en quelques-uns à la mer pour appâter une grosse prise !\""},
[210499] = {name = "Champifond", additional_info = "[q2]Utilise: À consommer (à vos risques et périls)."},
[210500] = {name = "[q2]Rune des étoiles", additional_info = "Lié quand ramassé\nUniqueClasses : Druide\n[q2]Grave sur votre pantalon la rune Éruption stellaire :\n\n\nLance de l’énergie stellaire qui inflige [248 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] à [304 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] points de dégâts des arcanes et augmente les dégâts de Feu stellaire pour 1 incantation de 80 % pendant 15 sec.\n\n Éruption stellaire déclenche la plupart des talents et effets qui déclenchent ou bénéficient de Colère ou Feu stellaire, et en bénéficie elle-même.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210534] = {name = "[q2]Idole du fauve", additional_info = "Lié quand ramassé\nUniqueRelique Idole\nClasses : Druide\n[q2]Grave sur votre poitrine ou votre robe la rune Frappes féroces :\n\n\nLorsque vous êtes en forme de félin, d’ours ou d’ours redoutable, les membres du groupe à moins de 20 mètres gagnent une férocité accrue en combat. Chaque coup en mêlée a 20 % de chances de conférer à l’attaquant une attaque supplémentaire avec 20 % de puissance d’attaque supplémentaire. Aucun effet si le membre du groupe bénéficie déjà de Totem Furie-des-vents.\n[q]\"Soignez 10 bêtes différentes, puis utilisez cette idole pour apprendre une nouvelle technique.\""},
[210568] = {name = "Phylactère décrépit", additional_info = "Lié quand ramassé\nUnique\n[q]\"Une aura infâme émane de cet artéfact.\""},
[210569] = {name = "[q2]Rune de Flagellation", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Grave sur votre poitrine la rune Flagellation :\n\n\nGagne un bonus de 25 % des dégâts physiques infligés pendant 12 sec après avoir activé Rage sanguinaire ou Rage de berserker.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210573] = {name = "[q2]Rune de Rage dévorante", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Grave sur votre pantalon la rune Consumé par la rage :\n\n\nVous enrage et vous accorde un bonus de 10 % aux dégâts de mêlée pendant 12 sec ou jusqu’à un maximum de 12 coups après avoir dépensé 80 points de rage.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210589] = {name = "[q2]Écho des ancêtres", additional_info = "Lié quand ramassé\nUniqueClasses : Chaman\nNiveau 3 requis\n[q2]Grave sur votre pantalon la rune Soutien ancestral :\n\n\nPendant 10 sec, 25 % de vos dégâts sont convertis en soins pour jusqu’à 3 membres du groupe proches, et 100 % de vos soins sont convertis en dégâts vers la cible la plus récente de votre Horion de flammes.\n[q]\"Permet d’apprendre une nouvelle technique de gravure.\""},
[210596] = {name = "[q2]Rune de Frappes de cobra", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur votre poitrine ou votre robe la rune Frappes de cobra :\n\n\nLorsque vous réussissez un coup critique avec vos techniques de Tir, les 2 prochaines attaques spéciales de votre familier deviennent des coups critiques.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210653] = {name = "[q2]Rune de Main gauche", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur vos gants la rune Main gauche :\n\n\nFrappe instantanément avec votre arme tenue en main gauche et inflige les dégâts normaux infligés avec la main gauche tout en augmentant vos chances de parer de 10 % pendant 10 sec. Octroie 3 points de combo.\n\n Main gauche bénéficie de tous les talents et effets qui se déclenchent à partir de ou modifient Attaque pernicieuse.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210654] = {name = "[q2]Notes de sort : Remonter le temps", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\n[q2]Grave sur vos gants la rune Remonter le temps :\n\n\nLa cible actuelle de votre Balise temporelle guérit instantanément de tous les dégâts subis au cours des 5 dernières secondes. Inefficace sur les cibles qui n’avaient pas de Balise temporelle il y a 5 s.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210655] = {name = "[q2]Notes de sort : MPERORENT LS ETME", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Déchiffre les notes de sort avec un charme de compréhension pour apprendre un nouveau sort de gravure."},
[210665] = {name = "Particule de rage torrentielle", additional_info = "Lié quand ramassé\nUnique"},
[210667] = {name = "Particule de rage infernale", additional_info = "Lié quand ramassé\nUnique"},
[210668] = {name = "Particule de rage sismique", additional_info = "Lié quand ramassé\nUnique"},
[210696] = {name = "[q2]Plaie de la pourriture", additional_info = "Lié quand ramassé\nMain droite Epée\nDégâts : 18 - 34 Vitesse 2.60\n(10.00 dégâts par seconde)\nDurabilité 60 / 60Classes : Guerrier\nNiveau 14 requis\n[q]\"Couverte de sang, cette lame ne brille plus à la lumière, mais sert de mise en garde…\""},
[210708] = {name = "Élixir des regrets accumulés", additional_info = "Niveau 20 requis\n[q2]Utilise: Sa consommation permet de discuter avec le cadavre d’un individu qui a laissé des affaires en suspens dans le monde mortel. Peut aussi guérir l’indigestion. (3 S Recharge)"},
[210709] = {name = "[q2]Recette : élixir des regrets accumulés", additional_info = "Alchimie (90) requis\n[q2]Utilise: Vous apprend à concocter un élixir des regrets accumulés.\nÉlixir des regrets accumulés\nNiveau 20 requis\n[q2]Utilise: Sa consommation permet de discuter avec le cadavre d’un individu qui a laissé des affaires en suspens dans le monde mortel. Peut aussi guérir l’indigestion. (3 S Recharge)\nRequiert Etouffante (5), Fiole plombée , Tombeline (5), Poussière d'âme"},
[210712] = {name = "Élixir de clairvoyance", additional_info = "Lié quand ramassé\n[q2]Utilise: Recevez une vision au feu de joie de Je’neu."},
[210713] = {name = "Âme torturée", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Utilise: Fait une offrande de sang pour libérer cette âme torturée."},
[210724] = {name = "Bâton de Hirzek", additional_info = "Lié quand ramassé"},
[210741] = {name = "[q3]Roueur automatique", additional_info = "Lié quand ramassé\nDeux mains Masse\nDégâts : 53 - 85 Vitesse 2.00\n(34.50 dégâts par seconde)\n+22 Force\n+8 Agilité\nDurabilité 100 / 100Classes : Paladin , Chaman , Druide\nNiveau 40 requis\n[q2]Équipé : +69 à la puissance d’attaque pour les formes de félin, d’ours et d’ours redoutable uniquement.\n[q2]Utilise: Augmente votre vitesse d'attaque de 50% pendant 30 sec. (3 Min Recharge)\n[q]\"Une variété d’améliorations ont été apportées pour rendre le modèle de l’année plus performant.\"\nDépouillé sur: Disperseur de foule 9-60\nChance de Butin: 13.51%"},
[210746] = {name = "[q2]Rune de Bouclier de terre", additional_info = "Lié quand ramassé\nUniqueClasses : Chaman\n[q2]Grave sur votre pantalon la rune Bouclier de terre :\n\n\nProtects the target with an earthen shield, reducing casting or channeling time lost when damaged by 30% Â and causing attacks to heal the shielded target for [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100]. Â This effect can only occur once every few seconds. Â 9 charges. Lasts 10 min. Â Earth Shield can only be placed on one target at a time and only one Elemental Shield can be active on a target at a time.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210763] = {name = "Branche d’Altek", additional_info = "Lié quand ramassé\nUnique\n[q]\"Un fragment de pouvoir. Il semble que cet objet faisait autrefois partie d’une grande arme.\""},
[210765] = {name = "Orbe de Des", additional_info = "Lié quand ramassé\nUnique\n[q]\"Des flammes et une magie noire tourbillonnent dans l’orbe, avec une danse inquiétante mais fascinante.\""},
[210771] = {name = "[q2]Fournitures égarées : barres de cuivre", additional_info = "Lié quand ramassé\nUnique : [Waylaid Shipment] (12)\n[q2]Utilise: Ajoute 20 barres de cuivre pour compléter la cargaison."},
[210772] = {name = "[q2]Cargaison d’approvisionnement : barres de cuivre", additional_info = "Lié quand ramassé\nUnique : [Supply Shipment] (1)\n[q]\"Livrez-la à un officier de ravitaillement pour recevoir une récompense conséquente.\""},
[210773] = {name = "[q3]Mantelet de la Deuxième guerre", additional_info = "Lié quand équipé\nEpaule Mailles\nArmure : 163\n+8 Endurance\nDurabilité 70 / 70\nNiveau 25 requis\n[q2]Équipé : Augmente les dégâts infligés par les sorts et effets du Sacré de 11 au maximum."},
[210779] = {name = "[q2]Plans : mantelet de la Deuxième guerre", additional_info = "Lié quand ramassé\nForge (150) requis\n[q2]Utilise: Vous apprend à forger un mantelet de la Deuxième guerre.\n[q3]Mantelet de la Deuxième guerre\nLié quand équipé\nEpaule Mailles\nArmure : 163\n+8 Endurance\nDurabilité 70 / 70\nNiveau 25 requis\n[q2]Équipé : Augmente les dégâts infligés par les sorts et effets du Sacré de 11 au maximum.\nRequiert Barre de bronze (20), Agate mousse (2), Pierre de lune inférieure (2), Perle iridescente (2), Barre d'argent (4)"},
[210781] = {name = "[q3]Bandages du phénix", additional_info = "Lié quand équipé\nPoignets Tissu\nArmure : 21\nDurabilité 30 / 30\nNiveau 25 requis\n[q2]Équipé : Augmente les dégâts infligés par les sorts et effets de Feu de 13 au maximum."},
[210794] = {name = "[q4]Cuirasse changeante en argent", additional_info = "Lié quand ramassé\nUnique - Équipé : [Void-Touched] (1)Torse Mailles\nArmure : 238\n+12 Force\n+5 Endurance\nDurabilité 145 / 145\nNiveau 25 requis\nForge (100) requis\n[q2]Équipé : Cet objet est imprégné du pouvoir brut du Vide. Lorsque la personne qui le porte est attaquée, cet objet a une forte chance d’infliger une terrible malédiction, à cause de laquelle l’adversaire ayant lancé l’attaque subira des dégâts accrus de toutes les sources pendant 15 s. (Chance d'occurence :25%)\n[q2]Équipé : Augmente de 1 % les chances de toucher avec tous les sorts et attaques."},
[210795] = {name = "[q4]Bottes en soie d’araignée extraplanaires", additional_info = "Lié quand ramassé\nUnique - Équipé : [Void-Touched] (1)Pieds Tissu\nArmure : 35\n+5 Endurance\n+5 Intelligence\n+6 Esprit\nDurabilité 50 / 50\nNiveau 25 requis\nCouture (100) requis\n[q2]Utilise: Entre momentanément dans un autre plan d’existence, ce qui réduit instantanément la menace, ainsi que les dégâts subis ou infligés de 30 % pendant 6 sec. (10 Min Recharge)\n[q2]Équipé : Augmente les soins et dégâts produits par les sorts et effets magiques de 7 au maximum.\n[q2]Équipé : Augmente de 1 % les chances de toucher avec tous les sorts et attaques."},
[210811] = {name = "[q2]Rune de Fureur primordiale", additional_info = "Lié quand ramassé\nUniqueClasses : Chaman\n[q2]Grave sur votre pantalon la rune Rage du chaman :\n\n\nReduces all damage you take by 20% and you regenerate mana equal to 5% of your maximum mana every second for 15 sec. Your party and raid members within 40 yards will also receive 20% of the mana you receive this way.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210817] = {name = "[q2]Rune de survie", additional_info = "Lié quand ramassé\nUniqueClasses : Druide\n[q2]Grave sur votre poitrine ou votre robe la rune Survie du plus fort :\n\n\nRéduit de 6 % les chances de subir un coup critique en mêlée et réduit de 10 % tous les dégâts subis. Les dégâts subis sont réduits de 10 % supplémentaires lorsque vous êtes en Forme d’ours ou Forme d’ours redoutable.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210818] = {name = "[q2]Rune du Loup solitaire", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur votre poitrine ou votre robe la rune Loup solitaire :\n\n\nVous infligez 30 % de dégâts supplémentaires avec toutes les attaques tant que vous n’avez pas de familier actif.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210820] = {name = "[q2]Rune de Sacrifice", additional_info = "Lié quand ramassé\nUniqueClasses : Paladin\n[q2]Grave sur votre pantalon la rune Sacrifice divin :\n\n\n30 % des dégâts subis par les membres du groupe à moins de 30 m sont redirigés vers le paladin ou la paladine pendant 10 sec. Les dégâts qui le ou la font passer sous 20 % de points de vie interrompent l’effet et augmentent ses dégâts et soins de 10 % pendant 10 sec. Vous ne pouvez pas utiliser Sacrifice divin sous l’effet de Bénédiction de protection, Bouclier divin ou Protection divine, ni être la cible de ces techniques tant que Sacrifice divin est actif.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210822] = {name = "[q2]Épiphanie harmonieuse", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur votre poitrine ou votre robe la rune Heureux hasard :\n\n\nSoigner une cible avec Soins rapides réduit le temps d’incantation de votre prochain sort Soins inférieurs, Soins, Soins supérieurs ou Prière de soins de 20 % pendant 20 sec. Cumulable jusqu’à 3 fois.\n[q]\"Permet d’apprendre une nouvelle technique de gravure.\""},
[210823] = {name = "[q2]Rune de Spécialisation Ambidextrie", additional_info = "Lié quand ramassé\nUniqueClasses : Chaman\n[q2]Grave sur votre poitrine ou votre robe la rune Spécialisation Ambidextrie :\n\n\nAugmente les chances de toucher avec les sorts et les attaques de mêlée de 10 % lorsque vous utilisez deux armes. Frappe-tempête frappe à présent avec les deux armes lorsque vous en utilisez deux. Augmente les dégâts de l’arme en main gauche de 50 %.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210824] = {name = "[q2]Rune du pacte", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur votre pantalon la rune Pacte démoniaque :\n\n\nLes coups critiques de votre familier appliquent l’effet Pacte démoniaque aux membres de votre groupe pendant 45 sec. Pacte démoniaque augmente les dégâts des sorts et les soins de 10 % des dégâts de vos sorts ou de ( 60 / 2), selon la valeur la plus élevée. Ne fonctionne pas sur les démons subjugués.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210825] = {name = "[q2]Rune de Porteguerre", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Grave sur votre poitrine la rune Porteguerre :\n\n\nVos techniques Charge, Interception et Intervention sont à présent utilisables en combat et avec n’importe quelle posture et dissipent tous les effets affectant le déplacement lorsqu’elles sont activées.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210953] = {name = "Œil de Bhossca", additional_info = "Lié quand ramassé\nUnique\n[q]\"Cet œil est inanimé, mais vous sentez qu’on vous observe…\""},
[210955] = {name = "Uniforme d’initié écarlate", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Déguisez-vous en membre de la Croisade écarlate. Toute activité louche rendra le déguisement inutile."},
[210963] = {name = "Clé de clairvoyant", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur"},
[210966] = {name = "Sang de la Légion", additional_info = "Objet de quête\nUnique (10)\n[q]\"Sombre, épais… ce sang est celui des grands commandants de la Légion.\""},
[210967] = {name = "Message confidentiel", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]<Clique Droit pour Lire>"},
[210968] = {name = "Clé du reliquaire", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur"},
[210979] = {name = "[q2]Rune de Pas de l’ombre", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur votre ceinture la rune Pas de l’ombre :\n\n\nVous tentez de marcher à travers les ombres et de réapparaître derrière votre ennemi. Votre vitesse de déplacement est augmentée de 70 % pendant 3 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[210980] = {name = "[q2]Rune de transformation", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur vos gants la rune Métamorphose :\n\n\nVous vous transformez en démon, ce qui augmente l’Armure de 500 %, réduit les chances de subir un coup critique de 6 %, augmente la génération de menace de 50 %, augmente le mana gagné grâce à Connexion de 100 %, modifie le fonctionnement de certaines techniques et en ajoute de nouvelles :\n\n Douleur brûlante devient instantanée.\n\n Trait de l’ombre devient Enchaînement d’ombre, une attaque en mêlée qui inflige des dégâts d’ombre à un maximum de 3 ennemis proches mais a un temps de recharge de 6 s.\n\n Peur est remplacée par Menace.\n\n\nProvoque la cible et la force à vous attaquer. Aucun effet si elle est déjà en train de vous attaquer.\n\n Charge du démon\n\n\nCharge un ennemi et l’étourdit pendant 1 sec. Inutilisable en combat.\n\n Hurlement du démon\n\n\nForce tous les ennemis proches à focaliser leurs attaques sur vous pendant 6 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211205] = {name = "[q2]Rune de Cœur de lion", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur votre poitrine ou votre robe la rune Cœur de lion :\n\n\nInvoque le cœur d’un lion et augmente le total des caractéristiques des personnages alliés proches de 10 %, et le total de celles du chasseur ou de la chasseuse de 10 % supplémentaires.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211247] = {name = "[q2]Patron : Bandages du phénix", additional_info = "Lié quand ramassé\nCouture (125) requis\n[q2]Utilise: Vous apprend à coudre des bandages du phénix.\n[q3]Bandages du phénix\nLié quand équipé\nPoignets Tissu\nArmure : 21\nDurabilité 30 / 30\nNiveau 25 requis\n[q2]Équipé : Augmente les dégâts infligés par les sorts et effets de Feu de 13 au maximum.\nRequiert Rouleau d'étoffe de laine (6), Flasque d'huile (2), Bobine de fil raffiné (2)"},
[211263] = {name = "[q4]Corselet du jugement", additional_info = "Lié quand ramassé\nTorse Plaques\nArmure : 857\n+17 Force\n+25 Endurance\n+20 Intelligence\n+10 à la résistance Feu\n+10 à la résistance Nature\nDurabilité 165 / 165Classes : Paladin\nNiveau 60 requis\n[q2]Équipé : Défense augmentée de 6.\n[q2]Équipé : Augmente les dégâts et les soins produits par les sorts et effets magiques de 14 au maximum.\n[q2]Équipé : Augmente le score de blocage de votre bouclier de 32.\n\n[q]Redoute du jugement (0/8)\n[q0]Ceinture du jugement\nManchettes du jugement\nCorselet du jugement\nCouronne du jugement\nGantelets du jugement\nJambières du jugement\nSandales du jugement\nSpallières du jugement\n[q0](3) Set : Augmente de 10 le rayon d'effet des Auras d'un paladin.\n(5) Set : Augmente les dégâts et les soins produits par les sorts et effets magiques de 47 au maximum.\n(8) Set : Inflige 60 to 66 points de dégâts du Sacré supplémentaires à la cible du Jugement d'un Paladin."},
