[211384] = {name = "[q2]Sac de coursier robuste", additional_info = "Lié quand ramassé\nUnique\nConteneur 12 emplacements"},
[211385] = {name = "[q2]Rune de Propagation du serpent", additional_info = "Lié quand ramassé\nUniqueClasses : Chasseur\n[q2]Grave sur votre pantalon la rune Propagation du serpent :\n\n\nLes cibles touchées par vos Flèches multiples sont également affectées par votre Morsure de serpent pendant 6 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211386] = {name = "[q2]Notes de sort : Éruption d’arcanes", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\n[q2]Grave sur votre pantalon la rune Éruption d’arcanes :\n\n\nLibère tout votre mana restant dans une vague d’énergie concentrée sur la cible, infligeant de [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 226 / 100] à [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 264 / 100] points de dégâts des arcanes, majorés de 300 % en fonction de votre mana restant. Ensuite, votre régénération normale de mana est activée et augmentée de 300 % pendant 8 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211387] = {name = "[q2]Rune de Guide de lumière", additional_info = "Lié quand ramassé\nUniqueClasses : Paladin\n[q2]Grave sur vos gants la rune Guide de lumière :\n\n\nLa cible devient un Guide de lumière pour tous les membres de votre groupe ou raid se trouvant dans un rayon de 40 m. Tous les soins que vous lancez sur ces cibles soignent également le guide pour un montant de points de vie égal à 100 % des soins prodigués. Une seule cible à la fois peut être le Guide de lumière. Dure 1 min.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211390] = {name = "[q2]Rune de Taquinerie", additional_info = "Lié quand ramassé\nUniqueClasses : Voleur\n[q2]Grave sur votre poitrine ou votre robe la rune Juste une égratignure :\n\n\nRéduit les dégâts physiques subis de 20 % lorsque Danse des lames est active. De plus, réduit les chances de subir un coup critique en mêlée de 6 %, augmente considérablement la menace générée par toutes les actions et remplace Feinte par Persifler, qui force la cible à vous attaquer.\n\n\nProvoque la cible et la force à vous attaquer. Aucun effet si elle est déjà en train de vous attaquer.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211391] = {name = "[q2]Rune de Pluie guérisseuse", additional_info = "Lié quand ramassé\nUniqueClasses : Chaman\n[q2]Grave sur votre poitrine ou votre robe la rune Pluie guérisseuse :\n\n\nSélectionne une zone de 15 m autour du personnage-joueur ciblé et rend à tous les membres de son groupe dans cette zone [(29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) * 15 / 100] points de vie par seconde.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211392] = {name = "[q2]Rune d’Affliction éternelle", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur votre pantalon la rune Affliction éternelle :\n\n\nDrain de vie, Drain d’âme, Trait d’ombre, Enchaînement d’ombre, Douleur brûlante, Incinérer et Hanter rafraîchissent la durée de votre Corruption sur la cible à sa durée maximale.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211393] = {name = "[q2]Rune de Fureur obsessionnelle", additional_info = "Lié quand ramassé\nUniqueClasses : Guerrier\n[q2]Grave sur vos gants la rune Fureur obsessionnelle :\n\n\nLorsque vous utilisez deux armes, vos dégâts physiques et votre vitesse de déplacement sont augmentés de 10 %.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211419] = {name = "[q2]Poignée d’écailles changeantes", additional_info = "Lié quand ramassé\nUnique\n[q]\"Ces étranges écailles semblent scintiller légèrement, comme si elles n’étaient pas entièrement corporelles. Il est clair qu’une magie prodigieuse est à l’œuvre ici… si seulement vous pouviez trouver quelqu’un qui en sache plus à leur su\""},
[211420] = {name = "[q3]Talisman d’écailles changeantes", additional_info = "Lié quand ramassé\nBijou\n+5 Esprit\nNiveau 25 requis\n[q2]Équipé : Protège le personnage-joueur contre les effets des ténèbres écrasantes."},
[211421] = {name = "La boîte", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Tente d’utiliser une puissante source de la Lumière pour détruire la boîte.\n[q]\"Toucher la boîte à mains nues vous plonge immédiatement dans une profonde inquiétude… mais aussi dans un sentiment d’inspiration créative comme vous n’en avez jamais ressenti auparavant.\""},
[211422] = {name = "[q4]Tesson du Vide", additional_info = "Lié quand ramassé\nUnique\n[q]\"Tout ce qui reste de la boîte est un minuscule morceau de cristal parfaitement noir. Il semble aspirer et consumer la lumière.\""},
[211423] = {name = "[q4]Gants en cuir touché par le Vide", additional_info = "Lié quand ramassé\nUnique - Équipé : [Void-Touched] (1)Mains Cuir\n[q2]Armure : 110\n+6 Agilité\n+6 Endurance\n+4 Esprit\nDurabilité 70 / 70\nNiveau 25 requis\nTravail du cuir (100) requis\n[q2]Équipé : Augmente de 1 % les chances de toucher avec tous les sorts et attaques.\n[q2]Utilise: Plonge dans la folie, ce qui augmente la vitesse d’attaque de 10 % ainsi que la menace générée pendant 10 sec. (10 Min Recharge)"},
