[211472] = {name = "[q2]Libram de bannissement", additional_info = "Lié quand ramassé\nUniqueRelique Libram\nClasses : Paladin\nNiveau 24 requis\n[q2]Grave sur votre pantalon la rune Exorciste :\n\n\nExorcisme peut maintenant être lancé sur n’importe quelle cible et a 100 % de chances de coup critique supplémentaires contre les morts-vivants et les démons.\n[q]\"Permet d’acquérir une nouvelle technique après avoir lancé Renvoi des morts-vivants sur 5 adversaires et les avoir tués avec Exorcisme.\""},
[211476] = {name = "[q2]Rune de l’Éveil du feu", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur votre poitrine ou votre robe la rune Lac de feu :\n\n\nPluie de feu produit également sur le sol un lac de feu qui augmente les dégâts de feu que vous ou votre démon infligez aux adversaires affectés de 40 % pendant 15 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211477] = {name = "[q2]Rune d’Incinérer", additional_info = "Lié quand ramassé\nUniqueClasses : Démoniste\n[q2]Grave sur votre pantalon la rune Incinérer :\n\n\nBrûle votre adversaire en lui infligeant [222 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] à [258 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] points de dégâts et augmente les dégâts de feu que vous infligez de 25 % pendant 15 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211482] = {name = "Offrande Briselance", additional_info = "Lié quand ramassé\nUnique"},
[211487] = {name = "[q2]Explosifs de démolition", additional_info = "Lié quand ramassé\nUnique\n[q2]Utilise: Placez une bombe à mèche courte sur le sol devant vous.\n[q]\"Se semblent utiles que pour déblayer des gravats.\""},
[211488] = {name = "[q2]Rune du vengeur", additional_info = "Lié quand ramassé\nUniqueClasses : Paladin\n[q2]Grave sur votre pantalon la rune Bouclier du vengeur :\n\n\nLance sur un ennemi un bouclier sacré qui inflige de [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] à [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] points de dégâts du sacré, l’hébète et rebondit ensuite sur des ennemis proches. Le sort frappe 3 cibles au total. Dure 10 sec.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211490] = {name = "[q2]Prophétie des mille lumières", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur vos gants la rune Cercle de soins :\n\n\nRend de [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 130 / 100] à [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 144 / 100] points de vie aux membres du groupe du personnage-joueur ciblé à moins de 40 m de lui.\n[q2]Utilise: Permet de se concentrer sur la prophétie pour apprendre un nouveau sort. Nécessite d’avoir l’esprit concentré en ayant médité sur deux mystères spirituels d’Azeroth.\n[q]\"Permet d’apprendre une nouvelle technique de gravure.\""},
