[211500] = {name = "[q3]Bandeau résistant en étoffe", additional_info = "Lié quand ramassé\nUniqueTête Tissu\nArmure : 50\nDurabilité 50 / 50\nNiveau 20 requis\n[q2]Équipé : Réduit tous les dégâts subis et les chances d’être touché par un coup critique de 5 % dans le goulet des Chanteguerres."},
[211501] = {name = "[q4]Corselet de puissance", additional_info = "Lié quand ramassé\nTorse Plaques\nArmure : 749\n+27 Force\n+18 Endurance\n+10 à la résistance Feu\nDurabilité 165 / 165Classes : Guerrier\nNiveau 60 requis\n[q2]Équipé : Augmente vos chances d'infliger un coup critique de 1%.\n[q2]Équipé : Augmente vos chances de toucher de 1%.\n\n[q]Harnois de bataille de puissance (0/8)\n[q0]Ceinture de puissance\nBrassards de puissance\nCorselet de puissance\nGantelets de puissance\nCasque de puissance\nJambières de puissance\nEspauliers de puissance\nSandales de puissance\n[q0](3) Set : Augmente le score de blocage de votre bouclier de 30.\n(5) Set : Vous confère 20% de chances de gagner un point de rage supplémentaire lorsque vous subissez des dégâts. (Chance d'occurence :20%)\n(8) Set : Augmente le niveau de menace généré par Fracasser armure de 15%."},
