[211512] = {name = "[q0]Tunique de pourfendeur du Crépuscule", additional_info = "Lié quand ramassé\nTorse Cuir\nArmure : 103\n+13 Agilité\n+9 Endurance\nDurabilité 100 / 100\nNiveau 25 requis\n\n[q]Tenue en cuir de pourfendeur de Brassenoire (0/3)\n[q0]Capuche de pourfendeur du Crépuscule\nSouliers de pourfendeur du Crépuscule\nTunique de pourfendeur du Crépuscule\n[q0](2) Set : +12 à la puissance d'attaque.\n(3) Set : Augmente de 1 % les chances de toucher avec tous les sorts et attaques."},
[211514] = {name = "[q2]Notes de sorts : Régénération de masse", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\n[q2]Grave sur votre ceinture la rune Régénération de masse :\n\n\nRend aux membres du groupe du personnage-joueur ciblé à moins de 30 m de lui [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] points de vie en 3 sec et applique Balise temporelle à chaque cible pendant 15 s.\n\n Balise temporelle\n\nEnregistre la position spatio-temporelle de la cible. 80 % de tous les dégâts des arcanes infligés par le lanceur ou la lanceuse seront convertis en soins chronomantiques pour chaque cible actuelle de Balise temporelle du lanceur ou de la lanceuse. Ces soins sont réduits de 50 % sur vous-même, et également réduits de 80 % lorsque les dégâts sont infligés par des sorts des arcanes qui blessent plusieurs cibles.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
[211528] = {name = "Sombre clairvoyance", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Utilise: Permet de réfléchir près d’une tombe isolée en particulier dans le bois de la Pénombre pour recevoir une prophétie."},
[211530] = {name = "[q2]Prophétie de la ville ensorcelée", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur votre pantalon la rune Mot de pouvoir : Barrière :\n\n\nInvoque une barrière sacrée qui protège tous les membres du groupe à l’emplacement ciblé pendant 10 sec et réduit de 25 % les dégâts qui leur sont infligés. De plus, leurs incantations de sorts ne sont pas retardées par les dégâts subis.\n[q2]Utilise: Permet de se concentrer sur la prophétie pour apprendre un nouveau sort. Nécessite d’avoir l’esprit concentré en ayant médité sur deux mystères spirituels d’Azeroth."},
[211531] = {name = "[q2]Prophétie des sept visiteurs", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Grave sur votre poitrine ou votre robe la rune Force d’âme :\n\n\nSoins inférieurs, Soins, Soins supérieurs et Soins rapides réduisent la durée restante d’Âme affaiblie sur les cibles soignées de 4 s. De plus, les cibles de votre Mot de pouvoir : Bouclier gagnent de la rage en subissant des dégâts même si ces dégâts sont absorbés et Fureur vertueuse est déclenchée par l’absorption de dégâts de votre Mot de pouvoir : Bouclier comme s’il s’agissait de soins.\n[q2]Utilise: Permet de se concentrer sur la prophétie pour apprendre un nouveau sort. Nécessite d’avoir l’esprit concentré en ayant médité sur deux mystères spirituels d’Azeroth."},
[211534] = {name = "Clairvoyance primordiale", additional_info = "Lié quand ramassé\nUniqueClasses : Prêtre\n[q2]Utilise: Permet de réfléchir près d’un capturêve crin-de-chardon dans les hauteurs de la canopée pour recevoir une prophétie."},
[211691] = {name = "[q2]Notes de sorts : Déflagration des arcanes", additional_info = "Lié quand ramassé\nUniqueClasses : Mage\n[q2]Grave sur vos gants la rune Déflagration des arcanes :\n\n\nFrappe la cible avec de l’énergie et lui inflige de [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 453 / 100] à [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 527 / 100] points de dégâts des arcanes. Chaque fois que vous lancez Déflagration des arcanes, les dégâts et les soins de tous les autres sorts des arcanes sont augmentés de 15 %, mais le coût en mana de Déflagration des arcanes augmente de 175 %. Effet cumulable jusqu’à 4 fois. Dure 6 sec ou jusqu’à ce qu’un sort de dégâts d’arcanes ou de soins soit lancé.\n[q]\"Vous apprend une nouvelle technique de gravure.\""},
