[211846] = {name = "[q3]Plans : pierre à aiguiser de Brassenoire", additional_info = "Lié quand ramassé\nForge (100) requis\n[q2]Utilise: Vous apprend à forger une pierre à aiguiser de Brassenoire.\n\n[q2]Pierre à aiguiser de Brassenoire\n[q2]Utilise: Appliqué à l’arme ciblée, augmente les chances de toucher de 2 % pendant 30 minutes. Cet effet s’applique uniquement dans les profondeurs de Brassenoire.\n[q]\"Ces mystérieuses pierres enchantées semblent briller de plus en plus vivement à mesure que vous vous enfoncez dans les profondeurs de Brassenoire.\"\nRequiert Pierre à aiguiser grossière , Essence de magie inférieure"},
