[211849] = {name = "[q3]Formule : huile de mana de Brassenoire", additional_info = "Lié quand ramassé\nEnchantement (100) requis\n[q2]Utilise: Vous apprend à créer de l’huile de mana de Brassenoire.\n\n[q2]Huile de mana de Brassenoire\nNiveau 25 requis\n[q2]Utilise: Appliqué à l’arme ciblée, rend 12 points de mana toutes les 5 s et augmente le toucher des sorts de 2 % pendant 5 min. Cet effet s’applique uniquement dans les profondeurs de Brassenoire.\n5 ChargesRequiert Fiole plombée , Essence de magie supérieure , Poussière étrange (5)"},
